      nl: '-- Let op: Tenzij u uw query opslaat, zullen deze tabbladen NIET bewaard
        blijven als u uw cookies leegt of van browser verandert.


        '
      pt: ''
      pt_BR: '-- Nota: A menos que você salve sua consulta, estes guias NÃO irão persistir
        se você limpar seus cookies ou mudar de navegador.'
      ru: '-- Примечание: Пока вы не сохраните ваш запрос, эти вкладки НЕ будут сохранены,
        если вы очистите куки или смените браузер.


