    \ based."
  : ai_translations: {}
    metadata: {}
    msgid: "A waterfall chart is a form of data visualization that helps in understanding\n\
      \          the cumulative effect of sequentially introduced positive or negative\
      \ values.\n          These intermediate values can either be time based or category\
      \ based."
    occurances: []
    po_translations:
      ar: "المخطط الانحداري هو شكل من أشكال تصور البيانات التي تساعد في فهم\n    \
        \      التأثير التراكمي للقيم الموجبة أو السلبية المقدمة بالتتابع.\n     \
        \     يمكن أن تكون هذه القيم الوسيطة إما قائمة على الوقت أو على أساس الفئة."
      de: ''
      es: ''
      fr: ''
      it: ''
      ja: "ウォーターフォール チャートは、理解を容易にするデータ視覚化の形式です。\n          連続的に導入された正または負の値の累積効果。\n\
        \          これらの中間値は、時間ベースまたはカテゴリベースのいずれかにすることができます。"
      ko: ''
      nl: "Een waterval grafiek is een vorm van gegevensweergave die helpt om\n  \
        \        het cumulatieve effect van opeenvolgende positieve of negatieve waarden\
        \ te begrijpen.\n          Deze intermediate waarden kunnen gebaseerd zijn\
        \ op tijd of categorie."
      pt: ''
      pt_BR: ''
      ru: Водопад позволяет представить накопленный эффект от последовательности положительных
        и отрицательных факторов. Эти промежуточные значения могут представлять временные
        интервалы или категории.
      sk: ''
      sl: "Grafikon slapov je način prikaza, ki pomaga razumeti\n\tkumulativni učinek\
        \ zaporedja negativnih ali pozitivnih vrednosti.\n\tVmesne vrednosti so bodisi\
        \ kategorične bodisi časovne."
      tr: ''
      uk: ''
      zh: ''
      zh_TW: ''
    trimmed_msgid: "A waterfall chart is a form of data visualization that helps in\
      \ understanding\n          the cumulative effect of sequentially introduced\
      \ positive or negative values.\n          These intermediate values can either\
      \ be time based or category based."
