  : ai_translations: {}
    metadata: {}
    msgid: "Add filter clauses to control the filter's source query,\n           \
      \         though only in the context of the autocomplete i.e., these conditions\n\
      \                    do not impact how the filter is applied to the dashboard.\
      \ This is useful\n                    when you want to improve the query's performance\
      \ by only scanning a subset\n                    of the underlying data or limit\
      \ the available values displayed in the filter."
    occurances: []
    po_translations:
      ar: "إضافة عبارات عامل تصفية للتحكم في استعلام مصدر عامل التصفية ،\n       \
        \             على الرغم من أنه فقط في سياق الإكمال التلقائي ، أي هذه الشروط\n\
        \                    لا تؤثر على كيفية تطبيق الفلتر على لوحة المعلومات. هذا\
        \ مفيد\n                    عندما تريد تحسين أداء الاستعلام عن طريق فحص مجموعة\
        \ فرعية فقط\n                    من البيانات الأساسية أو الحد من القيم المتاحة\
        \ المعروضة في عامل التصفية."
      de: "Fügen Sie Filterklauseln hinzu, um die Anfrage der Filter-Quelle zu steuern.\n\
        \                    allerdings nur im Zusammenhang mit der Autovervollständigung,\
        \ d.h. diese Bedingungen\n                    wirken Sie sich nicht darauf\
        \ aus, wie der Filter auf das Dashboard angewendet wird. Das ist nützlich,\n\
        \                    wenn Sie die Antwortzeit der Abfrage verbessern möchten,\
        \ indem Sie nur eine Teilmenge\n                    der zugrunde liegenden\
        \ Daten scannen oder die verfügbaren Werte einschränken, die im Filter angezeigt\
        \ werden."
      es: ''
      fr: AjouteR des clauses de filtre pour contrôler la requête source du filtre,
        mais uniquement dans le contexte de la saisie semi-automatique, c'est-à-dire
        que ces conditions n'ont pas d'impact sur la manière dont le filtre est appliqué
        au tableau de bord. Cela est utile lorsque vous souhaitez améliorer les performances
        de la requête en n'analysant qu'un sous-ensemble des données sous-jacentes
        ou en limitant les valeurs disponibles affichées dans le filtre.
      it: ''
      ja: 'フィルター句を追加してフィルターのソース クエリを制御します。

        ただし、オートコンプリートのコンテキスト、つまりこれらの条件の場合に限ります。

        フィルターがダッシュボードに適用される方法には影響しません。これは便利です

        サブセットのみをスキャンしてクエリのパフォーマンスを向上させたい場合

        基になるデータの値を変更するか、フィルターに表示される使用可能な値を制限します。'
      ko: ''
      nl: "Voeg filterclausules toe om de bronquery van het filter te beheren,\n \
        \                   echter alleen in de context van de autocomplete i. .,\
        \ deze voorwaarden\n                    hebben geen invloed op hoe het filter\
        \ wordt toegepast op het dashboard. Dit is handig\n                    wanneer\
        \ u de prestaties van de zoekopdracht wilt verbeteren door alleen een subset\n\
        \                    van de onderliggende gegevens te scannen of de beschikbare\
        \ waarden in het filter te beperken."
      pt: ''
      pt_BR: "Adicionar cláusulas de filtro para controlar a consulta de origem do\
        \ filtro, \n embora apenas no contexto do preenchimento automático, ou seja,\
        \ esses condições \n não impactam como o filtro é aplicado para o painel.\
        \ Isso é util \n quando você quiser melhorar o desempenho da consulta apenas\
        \ analisando um subconjunto \n de dados subjacentes ou limitar os valores\
        \ disponíveis apresentados no filtro."
      ru: Добавьте дополнительные условия к запросу, получающему список значений для
        фильтра. Пригодится, если нужно улучшить производительность запроса, ограничив
        его некоторой выборкой из всего набора данных или показывать не все возможные
        варианты в фильтре.
      sk: ''
      sl: "Doda stavke za filtriranje izvorne poizvedbe filtra,\n                \
        \    vendar samo v kontekstu samodejnega izpolnjevanja.\n                \
        \    Ne vpliva na to kako bo filter deloval na nadzorno ploščo.\n        \
        \            Uporabno je, če želite izboljšati učinkovitost poizvedbe filtra\n\
        \                     ali pa omejiti nabor prikazanih vrednosti filtra."
      tr: ''
      uk: "Додайте застереження про фільтр для контролю запиту джерела фільтра,\n\
        \                    Хоча лише в контексті автозаповнення, тобто ці умови\n\
        \                    Не впливайте на те, як фільтр застосовується на інформаційній\
        \ панелі. Це корисно\n                    Коли ви хочете покращити продуктивність\
        \ запиту, лише скануючи підмножину\n                    базових даних або\
        \ обмежити наявні значення, відображені у фільтрі."
      zh: 为控制筛选器的源查询添加筛选条件，但这只限于自动完成的上下文，即这些条件不会影响筛选器在仪表板上的应用方式。当你希望通过只扫描底层数据的一个子集来提高查询性能，或者限制筛选器中显示的可用值范围时，这一点特别有用。
      zh_TW: 為控制篩選器的源查詢增加篩選條件，但這只限於自動完成的上下文，即這些條件不會影響篩選器在仪表板上的應用方式。當你希望通過只掃描底層數據的一個子集來提高查詢性能，或者限制篩選器中顯示的可用值範圍時，這一點特别有用。
    trimmed_msgid: "Add filter clauses to control the filter's source query,\n   \
      \                 though only in the context of the autocomplete i.e., these\
      \ conditions\n                    do not impact how the filter is applied to\
      \ the dashboard. This is useful\n                    when you want to improve\
      \ the query's performance by only scanning a subset\n                    of\
      \ the underlying data or limit the available values displayed in the filter."
