    same scale, but area charts stack the metrics on top of each other.
  : ai_translations: {}
    metadata: {}
    msgid: Area charts are similar to line charts in that they represent variables
      with the same scale, but area charts stack the metrics on top of each other.
    occurances: []
    po_translations:
      ar: تتشابه المخططات المساحية مع المخططات الخطية من حيث أنها تمثل متغيرات بنفس
        المقياس ، لكن المخططات المساحية تكدس المقاييس فوق بعضها البعض.
      de: Flächendiagramme ähneln Liniendiagrammen, da sie Variablen mit der gleichen
        Skala darstellen, aber Flächendiagramme stapeln die Metriken übereinander.
      es: ''
      fr: Les graphiques en aires sont semblables aux diagrammes linéaires, car ils
        représentent des variables avec la même échelle, mais les graphiques en aires
        empilent les mesures les unes sur les autres.
      it: ''
      ja: 面グラフは、変数を同じスケールで表すという点で折れ線グラフに似ていますが、面グラフはメトリクスを互いに積み上げていきます。
      ko: ''
      nl: Vlakdiagrammen zijn vergelijkbaar met lijndiagrammen waarin ze variabelen
        met dezelfde schaal vertegenwoordigen, maar de grafieken stapelen de metrieken
        boven op elkaar.
      pt: ''
      pt_BR: Os gráficos de área são semelhantes aos gráficos de linhas na medida
        em que representam variáveis com a mesma escala, mas os gráficos de área empilham
        as métricas umas sobre as outras.
      ru: Диаграмма с областями представляет данные показателей в виде графиков, в
        которых значение каждого последующего показателя откладывается от предыдущего
      sk: ''
      sl: Ploščinski grafikoni so podobni črtnim grafikonom, saj predstavljajo spremenljivke
        v istem razmerju, vendar se pri ploščinskih grafikonih mere nalagajo ena na
        drugo.
      tr: ''
      uk: Діаграми області схожі на лінійні діаграми тим, що вони представляють змінні
        з однаковою шкалою, але діаграми області складають показники один до одного.
      zh: 时间序列面积图与折线图相似，因为它们表示具有相同比例的变量，但面积图将度量叠加在一起。超级集中的面积图可以是流式、堆栈式或展开式
      zh_TW: 時間序列面積圖與折線圖相似，因為它們表示具有相同比例的變量，但面積圖將度量叠加在一起。超級集中的面積圖可以是流式、堆栈式或展開式
    trimmed_msgid: Area charts are similar to line charts in that they represent variables
      with the same scale, but area charts stack the metrics on top of each other.
