  ? Bounds for numerical X axis. Not applicable for temporal or categorical axes.
    When left empty, the bounds are dynamically defined based on the min/max of the
    data. Note that this feature will only expand the axis range. It won't narrow
    the data's extent.
  : ai_translations: {}
    metadata: {}
    msgid: Bounds for numerical X axis. Not applicable for temporal or categorical
      axes. When left empty, the bounds are dynamically defined based on the min/max
      of the data. Note that this feature will only expand the axis range. It won't
      narrow the data's extent.
    occurances: []
    po_translations:
      ar: حدود المحور X العددي. لا ينطبق على المحاور الزمنية أو الفئوية. عند تركها
        فارغة ، يتم تحديد الحدود ديناميكيا بناء على الحد الأدنى / الأقصى للبيانات.
        لاحظ أن هذه الميزة ستوسع نطاق المحور فقط. لن يضيق نطاق البيانات.
      de: Grenzen für die Achse. Wenn sie leer gelassen werden, werden die Grenzen
        dynamisch basierend auf den Min/Max-Werten der Daten definiert. Beachten Sie,
        dass diese Funktion nur den Achsenbereich erweitert. Der Umfang der Daten
        wird dadurch nicht eingeschränkt.
      es: ''
      fr: ''
      it: ''
      ja: 数値 X 軸の範囲。時間軸またはカテゴリ軸には適用されません。空のままにすると、データの最小値/最大値に基づいて境界が動的に定義されます。この機能は軸の範囲を拡大するだけであることに注意してください。データの範囲は狭まりません。
      ko: ''
      nl: Grenzen voor numerieke X-as. Niet van toepassing voor tijdelijke of categorische
        assen. Wanneer leeg gelaten, worden de grenzen dynamisch gedefinieerd op basis
        van de min/max van de gegevens. Merk op dat deze functie alleen de as groter
        maakt. Het zal de grootte van de gegevens niet verkleinen.
      pt: ''
      pt_BR: Limites para o eixo. Quando deixados em branco, os limites são definidos
        dinamicamente com base no mínimo/máximo dos dados. Observe que esse recurso
        vai apenas expandir o intervalo do eixo. Não vai reduzir a extensão dos dados.
      ru: Если оставить поле пустым, границы динамически определяются на основе минимального/максимального
        значения данных. Обратите внимание, что эта функция только расширит диапазон
        осей. Она не изменит размер диаграммы.
      sk: ''
      sl: Meje numerične X-osi. Ni veljavno za časovne ali kategorične osi. Če je
        prazno, se meje nastavijo dinamično na podlagi min./max. vrednosti podatkov.
        Funkcija omeji le prikaz, obseg podatkov pa ostane enak.
      tr: ''
      uk: Межі для осі. Залишившись порожніми, межі динамічно визначаються на основі
        міні/максимуму даних. Зауважте, що ця функція лише розширить діапазон осі.
        Це не звузить ступінь даних.
      zh: Y轴的边界。当空时，边界是根据数据的最小/最大值动态定义的。请注意，此功能只会扩展轴范围。它不会缩小数据范围。
      zh_TW: Y 軸的邊界。當空時，邊界是根据數據的最小/最大值動態定義的。請注意，此功能只會擴展軸範圍。它不會縮小數據範圍。
    trimmed_msgid: Bounds for numerical X axis. Not applicable for temporal or categorical
      axes. When left empty, the bounds are dynamically defined based on the min/max
      of the data. Note that this feature will only expand the axis range. It won't
      narrow the data's extent.
