  ? CTAS (create table as select) can only be run with a query where the last statement
    is a SELECT. Please make sure your query has a SELECT as its last statement. Then,
    try running your query again.
  : ai_translations: {}
    metadata: {}
    msgid: CTAS (create table as select) can only be run with a query where the last
      statement is a SELECT. Please make sure your query has a SELECT as its last
      statement. Then, try running your query again.
    occurances: []
    po_translations:
      ar: لا يمكن تشغيل CTAS (إنشاء جدول كتحديد) إلا باستخدام استعلام حيث تكون العبارة
        الأخيرة عبارة عن SELECT. يرجى التأكد من أن استفسارك يحتوي على SELECT كبيان
        أخير له. ثم حاول تشغيل الاستعلام مرة أخرى.
      de: CTAS (create table as select) kann nur mit einer Abfrage ausgeführt werden,
        bei der die letzte Anweisung ein SELECT ist. Bitte stellen Sie sicher, dass
        Ihre Abfrage eine SELECT-Anweisung als letzte Anweisung hat. Versuchen Sie
        dann erneut, die Abfrage auszuführen.
      es: ''
      fr: CTAS (create table as select) n'a pas d'instruction SELECT à la fin. Assurez-vous
        que la requête a bien un SELECT en dernière instruction. Puis essayez d'exécuter
        votre requête à nouveau.
      it: ''
      ja: CTAS (選択としてテーブルを作成) は、最後のステートメントが SELECT であるクエリでのみ実行できます。クエリの最後のステートメントとして
        SELECT が含まれていることを確認してください。次に、クエリを再度実行してみます。
      ko: ''
      nl: CTAS (create table as select) kan alleen worden uitgevoerd met een query
        waarbij de laatste bewering een SELECT is. Zorg ervoor dat uw query als laatste
        verklaring een SELECT heeft. Probeer vervolgens uw zoekopdracht opnieuw uit
        te voeren.
      pt: ''
      pt_BR: O CTAS (criar tabela como select) só pode ser executado com uma consulta
        em que a última instrução seja um SELECT. Certifique-se de que a sua consulta
        tem um SELECT como última instrução. Depois, tente executar a consulta novamente.
      ru: CTAS (CREATE TABLE AS SELECT) может быть выполнен в запросе с единственным
        SELECT. Пожалуйста, убедитесь, что запрос содержит только один SELECT и выполните
        его заново.
      sk: ''
      sl: CTAS (create table as select) lahko izvajate le v poizvedbah, kjer je zadnji
        stavek SELECT. Poskrbite, da bo zadnji stavek v vaši poizvedbi SELECT in poskusite
        ponovno zagnati poizvedbo.
      tr: ''
      uk: CTA (створити таблицю як Select) можна запустити лише за допомогою запиту,
        де останнє твердження - це вибір. Будь ласка, переконайтеся, що ваш запит
        має вибір як останнє твердження. Потім спробуйте знову запустити свій запит.
      zh: CTA（create table as select）只能与最后一条语句为SELECT的查询一起运行。请确保查询的最后一个语句是SELECT。然后再次尝试运行查询。
      zh_TW: CTA（create table as select）只能與最後一條語句為 SELECT 的查詢一起運行。請確保查詢的最後一個語句是 SELECT。然後再次嘗試運行查詢。
    trimmed_msgid: CTAS (create table as select) can only be run with a query where
      the last statement is a SELECT. Please make sure your query has a SELECT as
      its last statement. Then, try running your query again.
