      uk: CVA (створити перегляд як Select) можна запустити лише за допомогою запиту
        з одним оператором SELECT. Будь ласка, переконайтеся, що ваш запит має лише
        оператор SELECT. Потім спробуйте знову запустити свій запит.
      zh: CVAS（createview as select）只能与带有单个SELECT语句的查询一起运行。请确保您的查询只有SELECT语句。然后再次尝试运行查询。
