  'Choose values that should be treated as null. Warning: Hive database supports only a single value':
    ai_translations: {}
    metadata: {}
    msgid: 'Choose values that should be treated as null. Warning: Hive database supports
      only a single value'
    occurances: []
    po_translations:
      ar: 'قائمة Json بالقيم التي يجب التعامل معها على أنها خالية. أمثلة: [""] للسلاسل
        الفارغة، ["لا شيء"، "N/A"]، ["nan"، "null"]. تحذير: تدعم قاعدة بيانات Hive
        قيمة واحدة فقط'
      de: 'Json-Liste der Werte, die als null behandelt werden sollen. Beispiele:
        [""] für leere Zeichenketten, ["Keine", "N/A"], ["nan", "null"]. Warnung:
        Hive-Datenbank unterstützt nur einen einzigen Wert'
      es: ''
      fr: 'Liste Json des valeurs qui doivent être traitées comme nulles. Exemples
        : [« »] pour les chaînes vides, [« None », « N/A »], [« nan », « null »].
        Attention : La base de données Hive ne prend en charge qu''une seule valeur'
      it: ''
      ja: 'null として扱う必要がある値の Json リスト。例: 空の文字列の場合は [""]、["None"、"N/A"]、["nan"、"null"]。警告:
        Hive データベースは単一の値のみをサポートします'
      ko: ''
      nl: 'Json lijst van waarden die als nul moeten worden behandeld. Voorbeelden:
        [""] voor lege strings, ["None", "N/A"], ["nan", "null"]. Waarschuwing: Hive
        database ondersteunt slechts een enkele waarde'
      pt: ''
      pt_BR: 'Lista Json dos valores que devem ser tratados como nulos. Exemplos:
        [""] para cadeias de caracteres vazias, ["None", "N/A"], ["nan", "null"].
        Aviso: O banco de dados Hive suporta apenas um único valor'
      ru: Список JSON-значений, которые следует рассматривать как пустые. База данных
        Hive поддерживает только одно значение.
      sk: ''
      sl: 'JSON seznam vrednosti, ki bodo obravnavane kot prazne (Null). Primeri:
        [""] za prazne nize, ["None", "N/A"], ["nan", "null"]. Opozorilo: Podatkovna
        baza Hive podpira le eno vrednost'
      tr: ''
      uk: 'Список JSON значень, які слід розглядати як NULL. Приклади: [""] для порожніх
        рядків, ["Немає", "n/a"], ["nan", "null"]. Попередження: база даних HIVE підтримує
        лише одне значення'
      zh: 应视为null的值的Json列表。例如：[""], ["None", "N/A"], ["nan", "null"]。警告：Hive数据库仅支持单个值。用
        [""] 代表空字符串。
      zh_TW: 應視為 null 的值的 Json 列表。例如：[""], ["None", "N/A"], ["nan", "null"]。警告：Hive
        資料庫僅支持單個值。用 [""] 代表空字符串。
    trimmed_msgid: 'Choose values that should be treated as null. Warning: Hive database
      supports only a single value'
