  : ai_translations: {}
    metadata: {}
    msgid: Data could not be deserialized from the results backend. The storage format
      might have changed, rendering the old data stake. You need to re-run the original
      query.
    occurances: []
    po_translations:
      ar: لا يمكن إلغاء تسلسل البيانات من الواجهة الخلفية للنتائج. ربما تغير تنسيق
        التخزين ، مما يجعل حصة البيانات القديمة. تحتاج إلى إعادة تشغيل الاستعلام الأصلي.
      de: Daten konnten nicht aus dem Ergebnis-Backend deserialisiert werden. Das
        Speicherformat hat sich möglicherweise geändert, wodurch die alten Daten ungültig
        wurden. Sie müssen die ursprüngliche Abfrage erneut ausführen.
      es: ''
      fr: Les données n'ont pas pu être désérialisées à partir du programme dorsal
        des résultats. Le format de stockage peut avoir changé, rendant les anciennes
        données inutilisables. Vous devez réexécuter la requête initiale.
      it: ''
      ja: データを結果バックエンドから逆シリアル化できませんでした。ストレージ形式が変更され、古いデータステークがレンダリングされた可能性があります。元のクエリを再実行する必要があります。
      ko: ''
      nl: Gegevens konden niet gedeserialiseerd worden vanuit de resultaten uit de
        backend. Het opslag formaat kan veranderd zijn, het weergeven van de oude
        data duur. U moet de originele query opnieuw uitvoeren.
      pt: ''
      pt_BR: Os dados não puderam ser desserializados do backend de resultados. O
        formato de armazenamento pode ter mudado, tornando os dados antigos. É necessário
        executar novamente a consulta original.
      ru: Не удалось распознать данные с сервера. Формат хранилища мог измениться,
        что привело к потере старых данных. Запустить исходный запрос повторно.
      sk: ''
      sl: Podatkov ni bilo mogoče deserializirati iz zalednega sistema rezultatov.
        Lahko je prišlo do spremembe oblike zapisa. Ponovno zaženite izvorno poizvedbo.
      tr: ''
      uk: Дані не могли бути дезеріалізовані з результатів результатів. Формат зберігання,
        можливо, змінився, зробивши стару частку даних. Потрібно повторно запустити
        оригінальний запит.
      zh: 无法从结果后端反序列化数据。存储格式可能已经改变，呈现了旧的数据桩。您需要重新运行原始查询。
      zh_TW: 無法從结果後端反序列化數據。儲存格式可能已經改變，呈現了舊的數據桩。您需要重新運行原始查詢。
    trimmed_msgid: Data could not be deserialized from the results backend. The storage
      format might have changed, rendering the old data stake. You need to re-run
      the original query.
