    msgid: Define a javascript function that receives the data array used in the visualization
      and is expected to return a modified version of that array. This can be used
      to alter properties of the data, filter, or enrich the array.
    occurances: []
    po_translations:
      ar: حدد وظيفة جافا سكريبت التي تستقبل مصفوفة البيانات المستخدمة في التصور ومن
        المتوقع أن تقوم بإرجاع نسخة معدلة من تلك المصفوفة. يمكن استخدام هذا لتغيير
        خصائص البيانات أو التصفية أو إثراء المصفوفة.
      de: Definieren Sie eine JavaScript-Funktion, die das in der Visualisierung verwendete
        Daten-Array empfängt und eine geänderte Version dieses Arrays zurückgibt.
        Dies kann verwendet werden, um Eigenschaften der Daten zu ändern, zu filtern
        oder das Array anzureichern.
      es: ''
      fr: Définissez une fonction javascript qui reçoit le tableau de données utilisé
        dans la visualisation et qui doit renvoyer une version modifiée de ce tableau.
        Cette fonction peut être utilisée pour modifier les propriétés des données,
        filtrer ou enrichir le tableau.
      it: ''
      ja: 視覚化で使用されるデータ配列を受け取り、その配列の変更されたバージョンを返すことが期待される JavaScript 関数を定義します。これを使用して、データのプロパティを変更したり、配列をフィルターしたり、強化したりできます。
      ko: ''
      nl: Definieer een javascript functie die de in de visualisatie gebruikte data
        array ontvangt en verwacht een aangepaste versie van die array te retourneren.
        Dit kan worden gebruikt om de eigenschappen van de gegevens, het filteren
        of de array te verrijken.
      pt: ''
      pt_BR: Defina uma função javascript que receba a matriz de dados utilizada na
        visualização e que deva devolver uma versão modificada dessa matriz. Esta
