  : ai_translations: {}
    metadata: {}
    msgid: Disable data preview when fetching table metadata in SQL Lab.  Useful to
      avoid browser performance issues when using  databases with very wide tables.
    occurances: []
    po_translations:
      ar: قم بتعطيل معاينة البيانات عند جلب بيانات تعريف الجدول في SQL Lab. مفيد لتجنب
        مشاكل أداء المتصفح عند استخدام قواعد البيانات ذات الجداول الواسعة جدًا.
      de: Datenvorschau beim Abrufen von Tabellenmetadaten in SQL Lab deaktivieren.
        Nützlich, um Probleme mit der Browserleistung bei der Verwendung von Datenbanken
        mit sehr breiten Tabellen zu vermeiden.
      es: ''
      fr: Désactiver la prévisualisation des données lorsque vous récupérez les métadonnées
        des tableaux dans SQL Lab. Utile pour éviter les problèmes de performance
        du navigateur lors de l'utilisation de bases de données avec des tables très
        larges.
      it: ''
      ja: SQL Lab でテーブル メタデータを取得するときにデータ プレビューを無効にします。非常に幅の広いテーブルを含むデータベースを使用する場合に、ブラウザのパフォーマンスの問題を回避するのに役立ちます。
      ko: ''
      nl: Schakel datavoorvertoning uit bij het ophalen van tabelmetagegevens in SQL
        Lab. Handig om prestatieproblemen van de browser te voorkomen bij het gebruik
        van databases met zeer brede tabellen.
      pt: ''
      pt_BR: Desativar a pré-visualização de dados ao obter metadados de tabelas no
        SQL Lab.  Útil para evitar problemas de desempenho do navegador quando se
        utilizam bancos de dados com tabelas muito grandes.
      ru: Отключить предварительный просмотр данных при извлечении метаданных таблицы
        в SQL Lab. Полезно для избежания проблем с производительностью браузера при
        использовании баз данных с очень широкими таблицами.
      sk: ''
      sl: Izključite predogled podatkov pri pridobivanju metapodatkov v SQL laboratoriju.
        S tem se zmanjša obremenitev brskalnika pri podatkovnih bazah z zelo širokimi
        tabelami.
      tr: ''
      uk: Вимкнути попередній перегляд даних під час отримання метаданих таблиці в
        лабораторії SQL. Корисно, щоб уникнути проблем з продуктивністю браузера при
        використанні баз даних з дуже широкими таблицями.
      zh: 在 SQL 工具箱中获取表的元数据时禁用数据预览。当使用具有非常宽表的数据库时，这样做有助于避免浏览器性能问题。
      zh_TW: 在 SQL 工具箱中獲取表的元數據時禁用數據預覽。當使用具有非常寬表的資料庫時，這樣做有助於避免瀏覽器性能問題。
