  ? Displays connections between entities in a graph structure. Useful for mapping
    relationships and showing which nodes are important in a network. Graph charts
    can be configured to be force-directed or circulate. If your data has a geospatial
    component, try the deck.gl Arc chart.
  : ai_translations: {}
    metadata: {}
    msgid: Displays connections between entities in a graph structure. Useful for
      mapping relationships and showing which nodes are important in a network. Graph
      charts can be configured to be force-directed or circulate. If your data has
      a geospatial component, try the deck.gl Arc chart.
    occurances: []
    po_translations:
      ar: يعرض الاتصالات بين الكيانات في بنية الرسم البياني. مفيد لتخطيط العلاقات
        وإظهار العقد المهمة في الشبكة. يمكن تكوين مخططات الرسم البياني بحيث يتم توجيهها
        بالقوة أو تعميمها. إذا كانت بياناتك تحتوي على مكون جغرافي مكاني، فجرّب مخطط
        deck.gl Arc.
      de: Zeigt Verbindungen zwischen Elementen in einer Graphstruktur an. Nützlich,
        um Beziehungen abzubilden und zu zeigen, welche Knoten in einem Netzwerk wichtig
        sind. Graphen-Diagramme können so konfiguriert werden, dass sie kraftgesteuert
        sind oder zirkulieren. Wenn Ihre Daten über eine Geodatenkomponente verfügen,
        versuchen Sie es mit dem deck.gl Arc-Diagramm.
      es: ''
      fr: Affiche les connexions entre les entités dans une structure graphique. Utile
        pour cartographier les relations et montrer quels nœuds sont importants dans
        un réseau. Les graphiques peuvent être configurés pour être dirigés par la
        force ou circuler. Si vos données ont une composante géospatiale, essayez
        le graphique Arc de deck.gl.
      it: ''
      ja: グラフ構造内のエンティティ間の接続を表示します。関係をマッピングし、ネットワーク内でどのノードが重要であるかを示すのに役立ちます。グラフ チャートは、力を指定したり循環したりするように構成できます。データに地理空間コンポーネントが含まれている場合は、deck.gl
        円弧チャートを試してください。
      ko: ''
      nl: Toont verbindingen tussen entiteiten in een grafiekstructuur. Handig voor
        het toewijzen van relaties en tonen van welke knooppunten belangrijk zijn
        in een netwerk. Grafieken kunnen worden geconfigureerd om geforceerd te worden
        geleid of te circuleren. Als uw gegevens een geospatiële component hebben,
        probeer dan de deck.gl boog.
      pt: ''
      pt_BR: Apresenta ligações entre entidades numa estrutura gráfica. Útil para
        mapear relações e mostrar quais os nós que são importantes numa rede. Os gráficos
        podem ser configurados para serem dirigidos à força ou circularem. Se os seus
        dados tiverem um componente geoespacial, experimente o gráfico de arco deck.gl.
      ru: Показывает связи между сущностями в виде направленного или циклического
        графа. Диаграмма удобна, когда нужно показать, как сущности связаны друг с
        другом и какие из них наиболее важны. Если ваши данные содержат геоинформацию,
        попробуйте диаграмму "Дуга" deck.gl.
      sk: ''
      sl: Prikaže povezave med entitetami v strukturi grafa. Uporabno za prikaz razmerij
        in pomembnih točk v omrežju. Grafikon je lahko krožnega tipa ali z usmerjenimi
        silami. Če imajo podatki geoprostorsko komponento, poskusite grafikon decl.gl
        - Arc.
      tr: ''
      uk: Відображає з'єднання між об'єктами в структурі графів. Корисно для відображення
        відносин та показ, які вузли важливі в мережі. Діаграми графів можуть бути
        налаштовані на спрямування сили або циркуляцію. Якщо ваші дані мають геопросторову
        складову, спробуйте діаграму дуги Deck.gl.
      zh: 显示图形结构中实体之间的连接。用于映射关系和显示网络中哪些节点是重要的。图表可以配置为强制引导或循环。如果您的数据具有地理空间组件，请尝试使用deck.gl圆弧图表。
      zh_TW: 顯示圖形結構中實體之間的連接。用於映射關係和顯示網路中哪些節點是重要的。圖表可以配置為强制引導或循環。如果您的數據具有地理空間組件，請嘗試使用
        deck.gl 圆弧圖表。
    trimmed_msgid: Displays connections between entities in a graph structure. Useful
      for mapping relationships and showing which nodes are important in a network.
      Graph charts can be configured to be force-directed or circulate. If your data
      has a geospatial component, try the deck.gl Arc chart.
