    msgid: Duration (in seconds) of the caching timeout for charts of this database.
      A timeout of 0 indicates that the cache never expires, and -1 bypasses the cache.
      Note this defaults to the global timeout if undefined.
    occurances: []
    po_translations:
      ar: المدة (بالثواني) من مهلة التخزين المؤقت لمخططات قاعدة البيانات هذه. تشير
        المهلة 0 إلى أن ذاكرة التخزين المؤقت لا تنتهي أبدًا، وأن -1 يتجاوز ذاكرة التخزين
        المؤقت. لاحظ أن هذه الإعدادات الافتراضية هي المهلة العالمية إذا لم يتم تحديدها.
      de: Dauer (in Sekunden) des Caching-Timeouts für Diagramme dieser Datenbank.
        Ein Timeout von 0 gibt an, dass der Cache nie abläuft, und -1 umgeht den Cache.
        Beachten Sie, dass standardmäßig das globale Timeout verwendet wird, wenn
        kein Wert definiert wurde.
      es: ''
      fr: Durée (en secondes) du délai de mise en cache des graphiques de cette base
        de données. Un délai de 0 indique que le cache n'expire jamais, et -1 permet
        de contourner le cache. Notez que cette valeur correspond par défaut à la
        durée globale si elle n'est pas définie.
      it: ''
      ja: このデータベースのチャートのキャッシュ タイムアウトの期間 (秒単位)。タイムアウト 0 はキャッシュが期限切れにならないことを示し、-1 はキャッシュをバイパスします。未定義の場合、デフォルトでグローバル
        タイムアウトになることに注意してください。
      ko: ''
      nl: Duur (in seconden) van de caching time-out voor grafieken van deze database.
        Een time-out van 0 geeft aan dat de cache nooit verloopt, en -1 gaat voorbij
        aan de cache. Merk op dat de standaard timeout is ingesteld op de globale
        timeout indien niet gedefinieerd.
      pt: ''
      pt_BR: Duração (em segundos) do tempo limite do cache para gráficos desse banco
        de dados. Um tempo limite de 0 indica que o cache nunca expira, e -1 ignora
        o cache. Observe que o padrão é o tempo limite global se não for definido.
      ru: Продолжительность (в секундах) таймаута кэша для диаграмм, построенных на
        этой базе данных. Таймаут 0 означает, что кэш никогда не очистится. Обратите
        внимание, что если значение не задано, применяется значение по умолчанию из
        основной конфигурации.
      sk: ''
      sl: Trajanje (v sekundah) predpomnjenja za grafikon v tej podatkovni bazi. Vrednost
        0 označuje, da predpomnilnik nikoli ne poteče, -1 pa onemogoči predpomnjenje.
        V primeru, da ni definirano, ima globalno nastavitev.
      tr: ''
      uk: Тривалість (за секунди) тайм -ауту кешування для діаграм цієї бази даних.
