        кеш. Зверніть увагу на це за замовчуванням до глобального тайм -ауту, якщо
        він не визначений.
      zh: 该数据库图表缓存超时的持续时间（单位为秒）。超时时间设置为0表示缓存永不过期，设置为-1则表示绕过缓存。如果未定义，此项默认采用全局超时设置。
      zh_TW: 該資料庫圖表缓存超時的持續時間（單位為秒）。超時時間設定為0表示缓存永不過期，設定為-1则表示绕過缓存。如果未定義，此項預設採用全局超時設定。
