  : ai_translations: {}
    metadata: {}
    msgid: "Expects a formula with depending time parameter 'x'\n        in milliseconds\
      \ since epoch. mathjs is used to evaluate the formulas.\n        Example: '2x+5'"
    occurances: []
    po_translations:
      ar: "تتوقع صيغة تعتمد على معامل الوقت 'x'\n بالمللي ثانية منذ العصر. يتم استخدام\
        \ الرياضيات لتقييم الصيغ.\n مثال: «2x+5\""
      de: "Erwartet eine Formel mit abhängigem Zeitparameter 'x'\n        in Millisekunden\
        \ seit Startzeit der UNIX-Zeit (epoch). mathjs wird verwendet, um die Formeln\
        \ auszuwerten.\n        Beispiel: '2x+5'"
      es: ''
      fr: 'Attend une formule avec un paramètre de temps dépendant « x » en millisecondes
        depuis l''époque. mathjs est utilisé pour évaluer les formules.        Exemple
        : « 2x+5 »'
      it: ''
      ja: "時間パラメータ「x」に依存する数式が必要です\n        エポックからのミリ秒単位。 mathjs は数式の評価に使用されます。\n \
        \       例: 「2x+5」"
      ko: ''
      nl: "Verwacht een formule met afhankelijk tijdsparameter 'x'\n        in milliseconden\
        \ sinds epoch. mathjs wordt gebruikt om formules te evalueren.\n        Voorbeeld:\
        \ '2x+5'"
      pt: ''
      pt_BR: "Espera uma fórmula com o parâmetro de tempo dependente 'x'\n       \
        \ em milissegundos desde a época. mathjs é utilizado para avaliar as fórmulas.\n\
        \        Exemplo: '2x+5'"
      ru: 'Формула с зависимой переменной ''x'' в милисекундах с 1970 года (Unix-время).
        Для рассчета используется mathjs. Например: ''2x+5'''
      sk: ''
      sl: "Pričakovana je formula z odvisnim časovnim parametrom 'x'\n        v milisekundah\
        \ od epohe. Za vrednotenje formule je uporabljen mathjs.\n        Primer:\
        \ '2x +5'"
      tr: ''
      uk: "Очікує формули з параметром залежно від часу 'x'\n        У мілісекундах\
        \ з моменту епохи. MathJS використовується для оцінки формул.\n        Приклад:\
        \ '2x+5'"
      zh: ''
      zh_TW: ''
