  : ai_translations: {}
    metadata: {}
    msgid: 'Extra data to specify table metadata. Currently supports metadata of the
      format: `{ "certification": { "certified_by": "Data Platform Team", "details":
      "This table is the source of truth." }, "warning_markdown": "This is a warning."
      }`.'
    occurances: []
    po_translations:
      ar: 'بيانات إضافية لتحديد بيانات تعريف الجدول. يدعم حاليًا البيانات الوصفية
        للتنسيق: `{ "certification": { "certified_by": "Data Platform Team", "details":
        "This table is the source of truth." }, «warning_markdown»: «هذا تحذير.»}`.'
      de: 'Zusätzliche Daten zum Angeben von Tabellenmetadaten. Unterstützt derzeit
        Metadaten des Formats: ''{ "certification": { "certified_by": "Data Platform
        Team", "details": "This table is the source of truth." }, "warning_markdown":
        "This is a warning." } `.'
      es: ''
      fr: 'Données supplémentaires pour spécifier les métadonnées du tableau. Actuellement,
        les métadonnées sont prises en charge dans le format suivant : `{ « certification »:
        { « certified_by »: « Data Platform Team », « details »: « Ce tableau est
        la source de la vérité. » }, « warning_markdown »: « Ceci est un avertissement. »
        }`.'
      it: ''
      ja: 'テーブルのメタデータを指定するための追加データ。現在、次の形式のメタデータがサポートされています: `{ "certification": {
        "certified_by": "Data Platform Team", "details": "This table is the source
        of true." " }, "warning_markdown": "これは警告です。" }`。'
      ko: ''
      nl: 'Extra gegevens om tabelmetagegevens te specificeren. Ondersteunt momenteel
        metadata van het formaat: `{ "certification": { "certified_by": "Data Platform
        Team", "details": "Deze tabel is de bron van de waarheid. }, "warning_markdown":
        "Dit is een waarschuwing" }`.'
      pt: ''
      pt_BR: 'Dados extras para especificar metadados de tabela. Atualmente suporta
        metadados do formato: `{ "certification": { "certified_by": "Data Platform
        Team", "details": "This table is the source of truth." }, "warning_markdown":
        "This is a warning." }`.'
      ru: 'Дополнительные метаданные таблицы. В настоящий момент поддерживается следующий
        формат: `{ "certification": { "certified_by": "Руководитель отдела", "details":
        "Эта таблица - источник правды." }, "warning_markdown": "Это предупреждение."
        }`.'
      sk: ''
      sl: 'Dodatni podatki za tabelo metapodatkov. Trenutno je podprta naslednja oblika
        zapisa metapodatkov: `{ "certification": { "certified_by": "Tim za razvoj",
        "details": "Ta tabela je vir resnice." }, "warning_markdown": "To je opozorilo."
        }`.'
      tr: ''
      uk: 'Додаткові дані для визначення метаданих таблиць. В даний час підтримує
        метадані формату: `{" Сертифікація ": {" сертифікат_by ":" Команда платформи
