        "Це попередження". } `.'
      zh: '指定表元数据的额外内容。目前支持的认证数据格式为：`{ "certification": { "certified_by": "Data Platform
        Team", "details": "This table is the source of truth." } }`.'
      zh_TW: '指定表元數據的額外内容。目前支持的認證數據格式為：`{ "certification": { "certified_by": "Data
