  ? Filters with the same group key will be ORed together within the group, while
    different filter groups will be ANDed together. Undefined group keys are treated
    as unique groups, i.e. are not grouped together. For example, if a table has three
    filters, of which two are for departments Finance and Marketing (group key = 'department'),
    and one refers to the region Europe (group key = 'region'), the filter clause
    would apply the filter (department = 'Finance' OR department = 'Marketing') AND
    (region = 'Europe').
  : ai_translations: {}
    metadata: {}
    msgid: Filters with the same group key will be ORed together within the group,
      while different filter groups will be ANDed together. Undefined group keys are
      treated as unique groups, i.e. are not grouped together. For example, if a table
      has three filters, of which two are for departments Finance and Marketing (group
      key = 'department'), and one refers to the region Europe (group key = 'region'),
      the filter clause would apply the filter (department = 'Finance' OR department
      = 'Marketing') AND (region = 'Europe').
    occurances: []
    po_translations:
      ar: سيتم ربط الفلاتر التي لها نفس مفتاح المجموعة معًا داخل المجموعة، بينما سيتم
        دمج مجموعات التصفية المختلفة معًا. يتم التعامل مع مفاتيح المجموعة غير المحددة
        كمجموعات فريدة، أي لا يتم تجميعها معًا. على سبيل المثال، إذا كان الجدول يحتوي
        على ثلاثة فلاتر، اثنان منها للإدارات المالية والتسويق (مفتاح المجموعة = 'القسم')،
        وواحد يشير إلى المنطقة الأوروبية (مفتاح المجموعة = 'المنطقة')، فإن جملة التصفية
        ستطبق عامل التصفية (القسم = 'الشؤون المالية' أو القسم = 'التسويق') و (المنطقة
        = 'أوروبا').
      de: Filter mit demselben Gruppenschlüssel werden innerhalb der Gruppe ODER-verknüpft,
        während verschiedene Filtergruppen zusammen UND-verknüpft werden. Undefinierte
        Gruppenschlüssel werden als eindeutige Gruppen behandelt, d.h. nicht gruppiert.
        Wenn eine Tabelle beispielsweise drei Filter hat, von denen zwei für die Abteilungen
        Finanzen und Marketing (Gruppenschlüssel = 'Abteilung') sind und einer sich
        auf die Region Europa bezieht (Gruppenschlüssel = 'Region'), würde die Filterklausel
        den Filter anwenden (Abteilung = 'Finanzen' ODER Abteilung = 'Marketing')
        UND (Region = 'Europa').
      es: ''
      fr: Les filtres d'un groupe qui ont la même clé vont se combiner avec des OR,
        alors que des filtres de groupes différents vont se combiner avec des AND.
        Les groupes qui ont une clé indéfinie sont traités comme des groupes uniques,
        c'est-à-dire qu'ils ne sont pas regroupés. Par exemple, si une table a 3 filtres
        dont 2 sont pour les départements Finance et Marketing (clé de groupe « department »,
        et 1 se réfère à la région Europe (clé de groupe = « region »), la clause
        du filtre qui s'appliquerait serait (department = « Finance » OR department
        = « Marketing ») AND (region = « Europe »).
      it: ''
      ja: 同じグループ キーを持つフィルターはグループ内で OR 演算され、異なるフィルター グループは AND 演算されます。未定義のグループ キーは一意のグループとして扱われます。つまり、一緒にグループ化されません。たとえば、テーブルに
        3 つのフィルターがあり、そのうち 2 つは財務部門とマーケティング部門 (グループ キー = '部門') のもので、1 つは地域ヨーロッパ (グループ
        キー = '地域') を参照する場合、フィルター句はフィルター (部門 = '財務' OR 部門 = 'マーケティング') AND (地域 = 'ヨーロッパ')。
      ko: ''
      nl: Filters met dezelfde groepssleutel worden binnen de groep ge-ORed, terwijl
        verschillende filtergroepen samen met elkaar worden ge-ANDed. Niet-gedefinieerde
        groepssleutels worden behandeld als unieke groepen, d.w.z. ze worden niet
        gegroepeerd. Bijvoorbeeld, als een tabel drie filters heeft, waarvan er twee
        voor afdelingen Financiën en Marketing zijn (groepssleutel = 'afdeling'),
        en er wordt verwezen naar de regio Europa (groepssleutel = 'regio'), de filterclausule
        zou het filter toepassen (afdeling = 'Financiën' OR afdeling = 'Marketing')
        AND (regio = 'Europa').
      pt: ''
      pt_BR: Os filtros com a mesma chave de grupo serão agrupados dentro do grupo,
        enquanto os grupos de filtros diferentes serão agrupados. As chaves de grupo
        indefinidas são tratadas como grupos únicos, ou seja, não são agrupadas. Por
        exemplo, se uma tabela tiver três filtros, dos quais dois são para os departamentos
        Finanças e Marketing (chave de grupo = 'departamento') e um se refere à região
        Europa (chave de grupo = 'região'), a cláusula de filtro aplicaria o filtro
        (departamento = 'Finanças' OU departamento = 'Marketing') AND (região = 'Europa').
      ru: 'Фильтры в одинаковой группе будут объединены оператором OR, в то время
        как разные группы будут объединены с помощью AND. Если группа не указана,
        условие будет добавлено через AND. Например, если для таблицы настроено три
        фильтра, два из которых '
      sk: ''
      sl: Filtri z enakim skupinskim ključem bodo znotraj skupine združeni z OR funkcijo,
        medtem ko bodo različne skupine združene z AND funkcijo. Nedefinirani skupinski
        ključi so obravnavani kot unikatne skupine in niso združeni v svojo skupino.
        Npr., če ima tabela tri filtre, pri čemer sta dva za oddelka marketinga in
        financ (skupinski ključ = 'oddelek') tretji pa se nanaša na regijo Evropa
        (skupinski ključ = 'regija'), bo filtrski izraz (oddelek = 'Finance' OR oddelek
        = 'Marketing') AND (regija = 'Evropa').
      tr: ''
      uk: Фільтри з тим самим груповим ключем будуть розглянуті разом у групі, тоді
        як різні групи фільтрів будуть та разом. Невизначені групові ключі трактуються
        як унікальні групи, тобто не згруповані разом. Наприклад, якщо в таблиці є
        три фільтри, з яких два - для відділів фінансування та маркетинг (груповий
        ключ = 'відділ'), а один відноситься до регіону Європи (груповий ключ = 'регіон'),
        застереження про фільтр застосовуватиметься фільтр (відділ = "фінанси" або
        відділ = "маркетинг") та (регіон = "Європа").
      zh: 具有相同组key的过滤将在组中一起进行"OR"运算，而不同的过滤组将一起进行"AND"运算。未定义的组的key被视为唯一组，即不分组在一起。例如，如果表有三个过滤，其中两个用于财务部门和市场营销
        (group key = 'department')，其中一个表示欧洲地区(group key = 'region')，filter子句将应用过滤
        (department = 'Finance' OR department = 'Marketing') 和 (region = 'Europe')
      zh_TW: 具有相同組 key 的過濾將在組中一起進行 "OR" 運算，而不同的過濾組將一起進行 "AND" 運算。未定義的組的 key 被視為唯一組，即不分組在一起。例如，如果表有三個過濾，其中兩個用於财務部門和市场营销
        (group key = 'department')，其中一個表示欧洲地區(group key = 'region')，filter子句將應用過濾
        (department = 'Finance' OR department = 'Marketing') 和 (region = 'Europe')
    trimmed_msgid: Filters with the same group key will be ORed together within the
      group, while different filter groups will be ANDed together. Undefined group
      keys are treated as unique groups, i.e. are not grouped together. For example,
      if a table has three filters, of which two are for departments Finance and Marketing
      (group key = 'department'), and one refers to the region Europe (group key =
      'region'), the filter clause would apply the filter (department = 'Finance'
      OR department = 'Marketing') AND (region = 'Europe').
