  ? For regular filters, these are the roles this filter will be applied to. For base
    filters, these are the roles that the filter DOES NOT apply to, e.g. Admin if
    admin should see all data.
  : ai_translations: {}
    metadata: {}
    msgid: For regular filters, these are the roles this filter will be applied to.
      For base filters, these are the roles that the filter DOES NOT apply to, e.g.
      Admin if admin should see all data.
    occurances: []
    po_translations:
      ar: بالنسبة للفلاتر العادية، هذه هي الأدوار التي سيتم تطبيق عامل التصفية هذا
        عليها. بالنسبة للفلاتر الأساسية، هذه هي الأدوار التي لا ينطبق عليها عامل التصفية،
        على سبيل المثال Admin إذا كان يجب على المشرف رؤية جميع البيانات.
      de: Bei regulären Filtern sind dies die Rollen, auf die dieser Filter angewendet
        wird. Bei Basisfiltern sind dies die Rollen, auf die der Filter NICHT angewendet
        wird, z. B. Admin, wenn Admin alle Daten sehen soll.
      es: ''
      fr: Pour les filtres réguliers, il s'agit des rôles auxquels le filtre s'applique.
        Pour les filtres de base, il s'agit des rôles auxquels le filtre ne s'applique
        PAS, par exemple Admin si l'administrateur doit voir toutes les données.
      it: ''
      ja: 通常のフィルターの場合、これらはこのフィルターが適用される役割です。基本フィルターの場合、これらはフィルターが適用されない役割です。管理者がすべてのデータを表示する必要がある場合。
      ko: ''
      nl: Voor reguliere filters zijn dit de rollen waarop dit filter zal worden toegepast.
        Voor de basisfilters zijn dit de rollen waarop het filter NIET van toepassing
        is, bijv. Admin als de beheerder alle gegevens zou moeten zien.
      pt: ''
      pt_BR: Para os filtros regulares, estas são as funções às quais este filtro
        será aplicado. Para os filtros de base, estas são as funções às quais o filtro
        NÃO se aplica, por exemplo, Admin se o admin tiver de ver todos os dados.
      ru: Для обычных фильтров это те роли, к которым будет применяться фильтр. Для
        базовых фильтров это те роли, к которым фильтр НЕ будет применен. Например,
        Admin, если администраторы должны видеть все данные.
      sk: ''
      sl: Za regularne filtre so te vloge tiste, ki bodo filtrirane. Za osnovne filtre,
        so te vloge tiste, ki NE bodo filtrirane, npr. Admin, če naj administrator
        vidi vse podatke.
      tr: ''
      uk: Для регулярних фільтрів це ролі, до яких цей фільтр буде застосований. Для
        базових фільтрів це ролі, до яких фільтр не застосовується, наприклад Адміністратор,
        якщо адміністратор повинен побачити всі дані.
      zh: 对于常规过滤，这些是此过滤将应用于的角色。对于基本过滤，这些是过滤不适用的角色，例如Admin代表admin应该查看所有数据。
      zh_TW: 對於常規過濾，這些是此過濾將應用於的角色。對於基本過濾，這些是過濾不適用的角色，例如Admin代表admin應該查看所有數據。
    trimmed_msgid: For regular filters, these are the roles this filter will be applied
      to. For base filters, these are the roles that the filter DOES NOT apply to,
      e.g. Admin if admin should see all data.
