    main time series and each time shift; as the percentage change; or as the ratio
    between series and time shifts.'
  : ai_translations: {}
    metadata: {}
    msgid: 'How to display time shifts: as individual lines; as the difference between
      the main time series and each time shift; as the percentage change; or as the
      ratio between series and time shifts.'
    occurances: []
    po_translations:
      ar: 'كيفية عرض التحولات الزمنية: كخطوط فردية؛ أو كفرق بين السلسلة الزمنية الرئيسية
        وكل تحول زمني؛ أو كتغير النسبة المئوية؛ أو كنسبة بين السلاسل والتحولات الزمنية.'
      de: 'So zeigen Sie Zeitverschiebungen an: als einzelne Linien; als absolute
        Differenz zwischen der Hauptzeitreihe und jeder Zeitverschiebung; als prozentuale
        Veränderung; oder wenn sich das Verhältnis zwischen Reihe und Zeit verschiebt.'
      es: 'Cómo mostrar desplazamientos de tiempo: como líneas individuales; como
        la diferencia absoluta entre la serie de tiempo principal y cada desplazamiento
        de tiempo; como el cambio porcentual; o como la relación entre series y desplazamientos
        de tiempo.'
      fr: 'Comment afficher les décalages temporels : sous forme de lignes individuelles;
        sous forme de différence entre la série temporelle principale et chaque décalage
        temporel; sous forme de pourcentage de variation; ou sous forme de rapport
        entre les séries et les décalages temporels.'
      it: ''
      ja: 'タイムシフトを表示する方法: 個別の行として。メインの時系列と各タイムシフトの差として。変化率として；または、シリーズと時間の比率の変化として。'
      ko: ''
      nl: 'Hoe tijdsverschuivingen te tonen: als individuele regels; als verschil
        tussen de hoofdtijdreeks en elke keer verschuiven; als het percentage verandert;
        of als de verhouding tussen reeksen en tijdverschuivingen.'
      pt: ''
      pt_BR: ''
      ru: 'Как отобразить смещения во времени: как отдельные линии, как абсолютную
        разницу между основным временным рядом и каждым смещением, как процентное
        изменение или как соотношение между рядами и смещениями'
