  ? If Presto or Trino, all the queries in SQL Lab are going to be executed as the
    currently logged on user who must have permission to run them. If Hive and hive.server2.enable.doAs
    is enabled, will run the queries as service account, but impersonate the currently
    logged on user via hive.server2.proxy.user property.
  : ai_translations: {}
    metadata: {}
    msgid: If Presto or Trino, all the queries in SQL Lab are going to be executed
      as the currently logged on user who must have permission to run them. If Hive
      and hive.server2.enable.doAs is enabled, will run the queries as service account,
      but impersonate the currently logged on user via hive.server2.proxy.user property.
    occurances: []
    po_translations:
      ar: إذا كان Presto أو Trino، فسيتم تنفيذ جميع الاستعلامات في SQL Lab كمستخدم
        يقوم بتسجيل الدخول حاليًا والذي يجب أن يكون لديه إذن لتشغيلها. إذا تم تمكين
        Hive و Hive.server2.enable.doas، فسيتم تشغيل الاستعلامات كحساب خدمة، ولكن
        مع انتحال شخصية المستخدم الذي قام بتسجيل الدخول حاليًا عبر خاصية hive.server2.proxy.user.
      de: Für Presto oder Trino werden alle Abfragen in SQL Lab mit aktuell angemeldeter
        Benutzer*in ausgeführt, der über die Berechtigung zum Ausführen verfügen muss.
        Für Hive und falls hive.server2.enable.doAs aktiviert sind, werden die Abfragen
        über das Service-Konto ausgeführt, die Identität der aktuell angemeldeten
        Benutzer*in jedoch über die hive.server2.proxy.user-Eigenschaft berücksichtigt.
      es: Si Presto, todas las consultas en SQL Lab se ejecutarán como el usuario
        conectado actualmente que debe tener permiso para ejecutarlas. Si Hive y hive.server2.enable.doAs
        están habilitados, se ejecutarán las consultas como cuenta de servicio, pero
        suplantará al usuario conectado actualmente vía la propiedad de usuario de
        hive.server2.proxy.
      fr: Dans le cas de Presto ou Trino, toutes les requêtes dans SQL Lab seront
        exécutées en tant qu'utilisateur·rice connecté·e qui doit avoir la permission
        de les exécuter. Si Hive et hive.server2.enable.doAs sont activés, les requêtes
        seront exécutées en tant que compte de service, mais en usurpant l'identité
        de l'utilisateur·rice connecté·e via la propriété hive.server2.proxy.user.
      it: ''
      ja: Presto または Trino の場合、SQL Lab のすべてのクエリは、実行権限が必要な現在ログオンしているユーザーとして実行されます。
        Hive および hive.server2.enable.doAs が有効な場合、クエリはサービス アカウントとして実行されますが、hive.server2.proxy.user
        プロパティを介して現在ログオンしているユーザーになりすまします。
      ko: ''
      nl: Bij Presto of Trino, alle zoekopdrachten in SQL Lab zullen worden uitgevoerd
        als de momenteel ingelogde gebruiker die toestemming moet hebben om ze uit
        te voeren. Als bijenkorf en bijslag. erver2.enable.doAs is ingeschakeld, worden
        de zoekopdrachten als serviceaccount uitgevoerd, maar imiteer de momenteel
        ingelogde gebruiker via hive.server2.proxy.user eigenschap.
      pt: Se Presto, todas as consultas no SQL Lab serão executadas como o utilizador
        atualmente conectado que deve ter permissão para as executar. <br/> Se hive
        e hive.server2.enable.doAs estiver habilitado, serão executadas as queries
        como conta de serviço, mas deve personificar o utilizador atualmente conectado
        recorrendo à propriedade hive.server2.proxy.user.
      pt_BR: Se for o Presto ou o Trino, todas as consultas no SQL Lab serão executadas
        como o usuário conectado no momento, que deve ter permissão para executá-las.
        Se o Hive e o hive.server2.enable.doAs estiverem ativados, as consultas serão
        executadas como conta de serviço, mas representarão o usuário conectado no
        momento por meio da propriedade hive.server2.proxy.user.
      ru: Если вы используете Presto или Trino, все запросы в SQL Lab будут выполняться
        от авторизованного пользователя, который должен иметь разрешение на их выполнение.
        Если включены Hive и hive.server2.enable.doAs, то запросы будут выполняться
        через техническую учетную запись, но имперсонировать зарегистрированного пользователя
        можно через свойство hive.server2.proxy.user.
      sk: ''
      sl: V primeru Presto ali Trino se vse poizvedbe v SQL laboratoriju zaženejo
        pod trenutno prijavljenim uporabnikom, ki mora imeti pravice za poganjanje.
        Če je omogočen Hive in hive.server2.enable.doAs, poizvedbe tečejo pod servisnim
        računom, vendar je trenutno prijavljen uporabnik predstavljen z lastnostjo
        hive.server2.proxy.user.
      tr: ''
      uk: Якщо Presto або Trino, всі запити в лабораторії SQL будуть виконані як реєстрація
        в даний час користувачеві, який повинен мати дозвіл на їх запуск. Якщо hive
        and hive.server2.enable.doas увімкнено, запустить запити в якості облікового
        запису послуг, але представлять себе в даний час в даний час користувачеві
        через властивість hive.server2.proxy.user.
      zh: 如果使用Presto，SQL 工具箱中的所有查询都将被当前登录的用户执行，并且这些用户必须拥有运行它们的权限。如果启用 Hive 和 hive.server2.enable.doAs，将作为服务帐户运行查询，但会根据
        hive.server2.proxy.user 的属性伪装当前登录用户。
      zh_TW: 如果使用 Presto，SQL 工具箱中的所有查詢都將被當前登入的用戶執行，並且這些用戶必須拥有運行它們的權限。如果啟用 Hive 和 hive.server2.enable.doAs，將作為服務帳戶運行查詢，但會根据
        hive.server2.proxy.user 的属性偽裝當前登入用戶。
    trimmed_msgid: If Presto or Trino, all the queries in SQL Lab are going to be
      executed as the currently logged on user who must have permission to run them.
      If Hive and hive.server2.enable.doAs is enabled, will run the queries as service
      account, but impersonate the currently logged on user via hive.server2.proxy.user
      property.
