  : ai_translations: {}
    metadata: {}
    msgid: Important! Select this if the table is not already sorted by entity id,
      else there is no guarantee that all events for each entity are returned.
    occurances: []
    po_translations:
      ar: هام! حدد هذا إذا لم يتم فرز الجدول بالفعل حسب معرف الكيان، وإلا فلن يكون
        هناك ضمان بإرجاع جميع الأحداث لكل كيان.
      de: Wichtig! Wählen Sie diese Option, wenn die Tabelle nicht bereits nach Entitäts-ID
        sortiert ist, da sonst nicht garantiert ist, dass alle Ereignisse für jede
        Entität zurückgegeben werden.
      es: ''
      fr: Important! Sélectionnez cette option si le tableau n’est pas déjà triée
        par ID d’entité, sinon il n’y a aucune garantie que tous les événements pour
        chaque entité sont retournés.
      it: ''
      ja: 重要！テーブルがまだエンティティ ID で並べ替えられていない場合は、これを選択します。そうでない場合、各エンティティのすべてのイベントが返されるという保証はありません。
      ko: ''
      nl: Belangrijk! Selecteer dit als de tabel nog niet is gesorteerd op entiteit
        id, anders is er geen garantie dat alle gebeurtenissen voor elk entiteit worden
        teruggegeven.
      pt: ''
      pt_BR: Importante! Seleccione esta opção se a tabela ainda não estiver ordenada
        por id de entidade, caso contrário não há garantia de que todos os eventos
        de cada entidade sejam retornados.
      ru: Важно! Выберите, если таблица еще не отсортирована по ID. В противном случае
        нельзя гарантировать, что все события для каждого объекта будут отображены.
      sk: ''
      sl: Pomembno! Izberite, če tabela še ni razvrščena po ID entitete, v nasprotnem
        primeru ni nujno, da bodo vrnjeni vsi dogodki za posamezno entiteto.
      tr: ''
      uk: Важливо! Виберіть це, якщо таблиця ще не відсортована за ідентифікатором
        сутності, інакше немає гарантії, що всі події для кожної сутності повертаються.
      zh: 很重要！如果表尚未按实体ID排序，则选择此项，否则无法保证返回每个实体的所有事件。
