        normalerweise von SQLAlchemy verwendet wird.
      es: Esto se utiliza para proporcionar información de conexión para sistemas
        como Hive, Presto y BigQuery, que no conforman con la sintaxis normal de usuario:contraseña
        utilizada por SQLAlchemy.
      fr: 'Chaîne JSON qui contient des informations de configuration de connexion
        supplémentaires. Ceci est utilisé pour fournir des informations de connexion
        pour des systèmes comme Hive, Presto et BigQuery qui ne se conforment pas
        à la syntaxe utilisateur : normalement utilisée par SQLAlchemy.'
      it: ''
      ja: 追加の接続構成を含む JSON 文字列。これは、SQLAlchemy で通常使用されるユーザー名:パスワード構文に準拠しない Hive、Presto、BigQuery
        などのシステムに接続情報を提供するために使用されます。
      ko: ''
      nl: JSON string met extra verbindingsconfiguratie. Dit wordt gebruikt om verbindingsinformatie
        te verstrekken voor systemen zoals Hive, Presto en BigQuery die niet voldoen
        aan de gebruikersnaam:wachtwoord syntax normaal gesproken gebruikt door SQLAlchemy.
      pt: ''
      pt_BR: Cadeia de caracteres JSON contendo configuração de conexão adicional.
        Isso é usado para fornecer informações de conexão para sistemas como Hive,
        Presto e BigQuery, que não estão em conformidade com a sintaxe de nome de
        usuário:senha normalmente usada pelo SQLAlchemy.
      ru: JSON-строка, содержащая дополнительную информацию о соединении. Это используется
        для указания информации о соединении с такими системами как Hive, Presto и
        BigQuery, которые не укладываются в шаблон "пользователь:пароль", который
        обычно используется в SQLAlchemy.
      sk: ''
      sl: JSON niz, ki vsebuje dodatno konfiguracijo povezave. Uporablja se za zagotavljanje
        dodatnih informacij povezave za sisteme kot sta Presto in BigQuery, ki nista
        skladna s sintakso username:password, ki jo običajno uporablja SQLAlchemy.
      tr: ''
      uk: 'Рядок JSON, що містить додаткову конфігурацію з''єднання. Це використовується
        для надання інформації про з''єднання для таких систем, як Hive, Presto та
        BigQuery, які не відповідають імені користувача: синтаксис пароля, як правило,
        використовується SQLALCHEMY.'
      zh: 包含附加连接配置的JSON字符串。它用于为配置单元、Presto和BigQuery等系统提供连接信息，这些系统不符合SQLAlChemy通常使用的用户名：密码语法。
      zh_TW: 包含附加連接配置的 JSON 字符串。它用於為配置單元、Presto 和 BigQuery 等系统提供連接訊息，這些系统不符合 SQLAlChemy
        通常使用的用戶名：密碼語法。
    trimmed_msgid: JSON string containing additional connection configuration. This
      is used to provide connection information for systems like Hive, Presto and
      BigQuery which do not conform to the username:password syntax normally used
      by SQLAlchemy.
