  : ai_translations: {}
    metadata: {}
    msgid: Limiting rows may result in incomplete data and misleading charts. Consider
      filtering or grouping source/target names instead.
    occurances: []
    po_translations:
      ar: قد يؤدي تحديد الصفوف إلى بيانات غير كاملة ومخططات مضللة. فكّر في تصفية أسماء
        المصدر/الهدف أو تجميعها بدلاً من ذلك.
      de: Das Einschränken von Zeilen kann zu unvollständigen Daten und irreführenden
        Diagrammen führen. Erwägen Sie stattdessen, Quell-/Zielnamen zu filtern oder
        zu gruppieren.
      es: ''
      fr: Limiter les rangées peut entraîner des données incomplètes et des graphiques
        trompeurs. Envisagez plutôt de filtrer ou de regrouper les noms de source/cible.
      it: ''
      ja: 行を制限すると、データが不完全になり、グラフが誤解を招く可能性があります。代わりに、ソース/ターゲット名をフィルタリングまたはグループ化することを検討してください。
      ko: ''
      nl: Rijen beperken kan leiden tot onvolledige data en misleidende grafieken.
        Overweeg het filteren of groeperen van bron/doelnamen.
      pt: ''
      pt_BR: Limitar as linhas pode resultar em dados incompletos e gráficos errôneos.
        Em vez disso, considere filtrar ou agrupar nomes de origem/destino.
      ru: ''
      sk: ''
      sl: Omejitev vrstic lahko povzroči nepopolne podatke in zavajajoč grafikon.
        Premislite o uporabi filtriranja ali združevanja imen izvorov/ciljev.
      tr: ''
      uk: Обмеження рядків може призвести до неповних даних та оманливих діаграм.
        Подумайте про фільтрацію або групування джерел/цільових імен.
      zh: 限制行数可能导致不完整的数据和误导性的图表。可以考虑过滤或分组源/目标名称。
      zh_TW: 限制行數可能導致不完整的數據和误導性的圖表。可以考慮過濾或分組源/目標名稱。
    trimmed_msgid: Limiting rows may result in incomplete data and misleading charts.
      Consider filtering or grouping source/target names instead.
