  ? Limits the number of series that get displayed. A joined subquery (or an extra
    phase where subqueries are not supported) is applied to limit the number of series
    that get fetched and rendered. This feature is useful when grouping by high cardinality
    column(s) though does increase the query complexity and cost.
  : ai_translations: {}
    metadata: {}
    msgid: Limits the number of series that get displayed. A joined subquery (or an
      extra phase where subqueries are not supported) is applied to limit the number
      of series that get fetched and rendered. This feature is useful when grouping
      by high cardinality column(s) though does increase the query complexity and
      cost.
    occurances: []
    po_translations:
      ar: يحد من عدد المسلسلات التي يتم عرضها. يتم تطبيق استعلام فرعي مرتبط (أو مرحلة
        إضافية حيث لا يتم دعم الاستعلامات الفرعية) للحد من عدد السلاسل التي يتم جلبها
        وعرضها. هذه الميزة مفيدة عند التجميع حسب العمود (الأعمدة) ذات الأهمية العالية
        على الرغم من أنها تزيد من تعقيد الاستعلام وتكلفته.
      de: Begrenzt die Anzahl der Zeitreihen, die angezeigt werden. Eine Unterabfrage
        (oder eine zusätzliche Phase, falls Unterabfragen nicht unterstützt werden)
        wird angewendet, um die Anzahl der Zeitreihen zu begrenzen, die abgerufen
        und angezeigt werden. Diese Funktion ist nützlich, wenn Sie nach Dimension(en)
        mit hoher Kardinalität gruppieren, erhöht jedoch die Abfragekomplexität und
        -kosten.
      es: ''
      fr: Limite le nombre de séries affichées. Une sous-requête associée (ou une
        phase supplémentaire dans laquelle les sous-requêtes ne sont pas prises en
        charge) est appliquée pour limiter le nombre de séries qui sont récupérées
        et affichées. Cette fonctionnalité est utile lors du regroupement par colonne(s)
        de cardinalité(s) élevée(s) bien que cela augmente la complexité et le coût
        de la requête.
      it: ''
      ja: 表示されるシリーズの数を制限します。結合されたサブクエリ (またはサブクエリがサポートされていない追加のフェーズ) は、フェッチされてレンダリングされるシリーズの数を制限するために適用されます。この機能は、カーディナリティの高い列でグループ化する場合に便利ですが、クエリの複雑さとコストは増加します。
      ko: ''
      nl: Beperkt het aantal series die worden weergegeven. Een joined subquery (of
        een extra fase waar subquery's niet worden ondersteund) wordt toegepast om
        het aantal series dat wordt opgehaald en gerenderd te beperken. Deze functie
        is handig bij het groeperen van kolom(men) met een hoge kardinaliteit, maar
        verhoogt wel de query complexiteit en kosten.
      pt: ''
      pt_BR: Limita o número de séries que são exibidas. Uma subconsulta unida (ou
        uma fase extra em que não há suporte para subconsultas) é aplicada para limitar
        o número de séries que são obtidas e renderizadas. Esse recurso é útil ao
        agrupar por coluna(s) de alta cardinalidade, embora aumente a complexidade
        e o custo da consulta.
      ru: Ограничивает количество отображаемых рядов. Эта опция полезна для столбцов
        с большим количеством уникальных значений, хотя увеличивает сложность и стоимость
        запроса.
      sk: ''
      sl: Omeji število časovnih vrst za prikaz. S podpoizvedbo (ali dodatno fazo,
        kjer podpoizvedbe niso podprte) se omeji število časovnih vrst, ki bodo pridobljene
        za prikaz. Ta funkcija je uporabna pri združevanju s stolpci z veliko kardinalnostjo,
        vendar poveča kompleksnost poizvedbe.
      tr: ''
      uk: Обмежує кількість серій, які відображаються. Приєднаний підзапит (або додаткова
        фаза, де підтримуються підрозділи) застосовується для обмеження кількості
        серій, які отримують та надаються. Ця функція корисна при групуванні за допомогою
        стовпців (ів) високої кардинальності, хоча збільшує складність та вартість
        запитів.
      zh: 限制显示的系列数。应用联接的子查询(或不支持子查询的额外阶段)来限制获取和呈现的序列数量。此功能在按高基数列分组时很有用，但会增加查询的复杂性和成本。
      zh_TW: 限制顯示的系列數。應用聯接的子查詢(或不支持子查詢的額外階段)來限制獲取和呈現的序列數量。此功能在按高基數列分組時很有用，但會增加查詢的複雜性和成本。
    trimmed_msgid: Limits the number of series that get displayed. A joined subquery
      (or an extra phase where subqueries are not supported) is applied to limit the
      number of series that get fetched and rendered. This feature is useful when
      grouping by high cardinality column(s) though does increase the query complexity
      and cost.
