    msgid: Line chart is used to visualize measurements taken over a given category.
      Line chart is a type of chart which displays information as a series of data
      points connected by straight line segments. It is a basic type of chart common
      in many fields.
    occurances: []
    po_translations:
      ar: يتم استخدام المخطط الخطي لتصور القياسات المأخوذة على فئة معينة. المخطط الخطي
        هو نوع من المخططات التي تعرض المعلومات كسلسلة من نقاط البيانات المتصلة بمقاطع
        الخط المستقيم. إنه نوع أساسي من المخططات الشائعة في العديد من الحقول.
      de: Liniendiagramm wird verwendet, um Messungen zu visualisieren, die über eine
        bestimmte Kategorie durchgeführt wurden. Liniendiagramm ist eine Art Diagramm,
        das Informationen als eine Reihe von Datenpunkten anzeigt, die durch gerade
        Liniensegmente verbunden sind. Es ist ein grundlegender Diagrammtyp, der in
        vielen Bereichen üblich ist.
      es: El gráfico de linea (en series de tiempo) es un gráfico de linea utilizado  para
        visualizar medidas tomadas en intervalos de tiempo regulares. El gráfico de
        linea es un tipo de gráfico que muestra información de una serie de puntos
        de datos conectados por segmentos de lineas rectas. Es un tipo básico de gráfico
        en la estadística.
      fr: Le graphique linéaire est utilisé pour visualiser les mesures prises sur
        une catégorie donnée. Le graphique linéaire est un type de graphique qui affiche
        les informations sous forme de série de points de données reliés par des segments
        linéaires. Il s’agit d’un type de tableau de base commun dans de nombreux
        champs.
      it: ''
      ja: 折れ線グラフは、特定のカテゴリにわたって取得された測定値を視覚化するために使用されます。折れ線グラフは、情報を直線セグメントで接続された一連のデータ
        ポイントとして表示するグラフの一種です。多くの分野で一般的な基本的なタイプのチャートです。
      ko: ''
      nl: Lijndiagram wordt gebruikt voor het visualiseren van metingen over een bepaalde
        categorie. Een lijndiagram is een type grafiek dat informatie weergeeft als
        een serie gegevenspunten verbonden door rechte lijnsegmenten. Het is een basissoort
        grafiek dat op veel gebieden gebruikelijk is.
      pt: ''
      pt_BR: O gráfico de linhas é utilizado para visualizar as medições efetuadas
        numa determinada categoria. O gráfico de linhas é um tipo de gráfico que apresenta
        informações como uma série de pontos de dados ligados por segmentos de linha
        reta. É um tipo básico de gráfico comum em muitos domínios.
      ru: График используется для визуализации данных из одного ряда, категории. Информация
        на графике представляется в виде набора точек, соединенных отрезками. Это
        простая диаграмма, распространенная во многих областях.
      sk: ''
      sl: Črtni grafikon se uporablja se za vizualizacijo meritev zajetih skozi čas.
        Posamezne točke so med seboj povezane z ravnimi črtami.
      tr: ''
      uk: Лінійна діаграма використовується для візуалізації вимірювань, взяті на
        задану категорію. Лінійна діаграма - це тип діаграми, яка відображає інформацію
        як ряд точок даних, підключених за допомогою прямих сегментів. Це основний
        тип діаграми, поширений у багатьох полях.
      zh: 时间序列折线图用于可视化在规则时间间隔内进行的重复测量。折线图是一种图表，它将信息显示为一系列由直线段连接的数据点。它是许多领域中常见的一种基本类型的图表。
      zh_TW: 時間序列折線圖用於可視化在規則時間間隔内進行的重复测量。折線圖是一種圖表，它將訊息顯示為一系列由直線段連接的數據點。它是許多领域中常見的一種基本類型的圖表。
    trimmed_msgid: Line chart is used to visualize measurements taken over a given
      category. Line chart is a type of chart which displays information as a series
      of data points connected by straight line segments. It is a basic type of chart
      common in many fields.
