      de: Metrik, die verwendet wird, um zu definieren, wie die obersten Zeitreihen
        sortiert werden, wenn ein Zeitreihen- oder ein Zellen-Limit vorhanden ist.
        Wenn nicht definiert, wird auf die erste Metrik zurückgesetzt (falls zutreffend).
      es: ''
      fr: Mesure utilisée pour définir comment les séries principales sont triées
        si une limite de série ou de cellule est définie. Si indéfini, la première
        mesure sera utilisée (si approprié).
      it: ''
      ja: シリーズまたはセルの制限が存在する場合に、上位のシリーズを並べ替える方法を定義するために使用されるメトリック。未定義の場合は、最初のメトリック
        (該当する場合) に戻ります。
      ko: ''
      nl: Metriek wordt gebruikt om te bepalen hoe de top series worden gesorteerd
        als een serie of cel limiet aanwezig is. Indien ongedefinieerd wordt deze
        teruggekeerd naar de eerste metriek (indien gepast).
      pt: ''
      pt_BR: Métrica utilizada para definir a forma como as séries de topo são ordenadas
        se estiver presente um limite de série ou de célula. Se não for definida,
        reverte para a primeira métrica (quando apropriado).
      ru: Мера, используемая для определения того, как сортируются верхние категории,
        если присутствует ограничение по категории или ячейке. Если не определено,
        возвращается к первой мере (где это уместно).
      sk: ''
      sl: Mera, ki določa kako so razvrščene prve serije, če je določena omejitev
        serij ali vrstic. Če ni določena, se uporabi prva mera (kjer je ustrezno).
      tr: ''
      uk: Метрика, яка використовується для визначення того, як сортується верхня
        серія, якщо присутня ліміт серії або комірки. Якщо невизначений повернення
        до першої метрики (де це доречно).
