        \ الحد الأدنى أو الحد الأقصى فقط."
      de: "Zahlengrenzen, die für die Farbkodierung von Rot nach Blau verwendet werden.\n\
        \               Kehren Sie die Zahlen für Blau in Rot um. Um reines Rot oder\
        \ Blau zu erhalten,\n               können Sie entweder nur min oder max eingeben."
      es: ''
      fr: Bornes numériques utilisées pour le codage des couleurs du rouge au bleu.               Inversez
        les nombres pour le bleu vers le rouge. Pour obtenir un rouge ou un bleu pur,
        vous pouvez saisir uniquement min ou max.
      it: ''
      ja: "赤から青へのカラーエンコーディングに使用される数値境界。\n               青から赤の数字を逆にします。純粋な赤や青を得るには、\n\
        \               最小値または最大値のみを入力できます。"
      ko: ''
      nl: "Aantal grenzen gebruikt voor kleurencodering van rood naar blauw.\n   \
        \            Zet de getallen voor blauw naar rood om. Om alleen rood of blauw\
        \ te krijgen,\n               kan je de min of max invoeren."
      pt: ''
      pt_BR: "Limites numéricos utilizados para a codificação de cores de vermelho\
        \ para azul.\n Inverta os números de azul para vermelho. Para obter vermelho\
        \ ou azul puro,\n pode introduzir apenas o mínimo ou o máximo."
      ru: ''
      sk: ''
      sl: "Številske meje za kodiranje barv od rdeče do modre.\n\tZamenjajte števili\
        \ za barve od modre do rdeče. Če želite čisto rdečo ali modro,\n\tvnesite\
        \ samo min ali max."
