  ? Operate the database in asynchronous mode, meaning that the queries are executed
    on remote workers as opposed to on the web server itself. This assumes that you
    have a Celery worker setup as well as a results backend. Refer to the installation
    docs for more information.
  : ai_translations: {}
    metadata: {}
    msgid: Operate the database in asynchronous mode, meaning that the queries are
      executed on remote workers as opposed to on the web server itself. This assumes
      that you have a Celery worker setup as well as a results backend. Refer to the
      installation docs for more information.
    occurances: []
    po_translations:
      ar: قم بتشغيل قاعدة البيانات في الوضع غير المتزامن، مما يعني أن الاستعلامات
        يتم تنفيذها على العاملين عن بعد بدلاً من خادم الويب نفسه. يفترض هذا أن لديك
        إعداد عامل Celery بالإضافة إلى خلفية النتائج. راجع مستندات التثبيت لمزيد من
        المعلومات.
      de: Betreiben Sie die Datenbank im asynchronen Modus, was bedeutet, dass die
        Abfragen auf Remote-Workern und nicht auf dem Webserver selbst ausgeführt
        werden. Dies setzt voraus, dass Sie sowohl über ein Celery-Worker-Setup als
        auch über ein Ergebnis-Backend verfügen. Weitere Informationen finden Sie
        in den Installationsdokumenten.
      es: ''
      fr: Exploiter la base de données en mode asynchrone, ce qui signifie que les
        requêtes sont exécutées sur des travailleurs distants plutôt que sur le serveur
        web lui-même. Cela suppose que vous disposiez d'un collaborateur Celery ainsi
        que d'un programme dorsal de résultats. Reportez-vous à la documentation d'installation
        pour plus d'informations.
      it: ''
      ja: データベースを非同期モードで動作させます。Webサーバー自体ではなくリモートワーカーでクエリを実行します。この機能はCeleryワーカーと結果バックエンドがセットアップされていることを前提としています。詳細についてはインストールドキュメントを参照してください。
      ko: ''
      nl: Beheren van de database in asynchrone modus, wat betekent dat de query's
        worden uitgevoerd op externe werkers in tegenstelling tot op de webserver
        zelf. Dit veronderstelt dat u zowel een Celery werker als een resultaten backend
        heeft. Raadpleeg de installatie documenten voor meer informatie.
      pt: ''
      pt_BR: Operar o banco de dados em modo assíncrono, o que significa que as consultas
        são executadas em workers remotos e não no próprio servidor Web. Isso pressupõe
        que você tenha uma configuração do Celery worker, bem como um backend de resultados.
        Consulte os documentos de instalação para obter mais informações.
      ru: Работа с базой данных в асинхронном режиме означает, что запросы исполняются
        на удаленных воркерах, а не на веб-сервере Superset. Это подразумевает, что
        у вас есть установка с воркерами Celery. Обратитесь к документации по настройке
        за дополнительной информацией.
      sk: ''
      sl: Upravljanje podatkovne baze v asinhronem načinu pomeni, da se poizvedbe
        zaženejo na oddaljenih »delavcih« in ne na samem spletnem strežniku. S tem
        je predpostavljeno, da imate nastavljenega »delavca« za Celery in zaledni
        sistem za rezultate. Več informacij je v navodilih za namestitev.
      tr: ''
      uk: Керуйте базою даних в асинхронному режимі, що означає, що запити виконуються
        на віддалених працівниках на відміну від самого веб -сервера. Це передбачає,
        що у вас є налаштування працівника селери, а також резервні результати. Для
        отримання додаткової інформації зверніться до документів про встановлення.
      zh: 以异步模式操作数据库，即查询操作在远程工作节点上执行，而不是在Web服务器上执行。这意味着您需要设置有一个Celery工作节点以及一个结果后端。有关更多信息，请参考安装文档。
      zh_TW: 以異步模式操作資料庫，即查詢操作在遠程工作節點上執行，而不是在 Web 服務器上執行。這意味着您需要設定有一個 Celery 工作節點以及一個结果後端。有關更多訊息，請参考安裝文檔。
    trimmed_msgid: Operate the database in asynchronous mode, meaning that the queries
      are executed on remote workers as opposed to on the web server itself. This
      assumes that you have a Celery worker setup as well as a results backend. Refer
      to the installation docs for more information.
