  : ai_translations: {}
    metadata: {}
    msgid: Plots the individual metrics for each row in the data vertically and links
      them together as a line. This chart is useful for comparing multiple metrics
      across all of the samples or rows in the data.
    occurances: []
    po_translations:
      ar: يرسم المقاييس الفردية لكل صف في البيانات عموديًا ويربطها معًا كخط. يعد هذا
        المخطط مفيدًا لمقارنة مقاييس متعددة عبر جميع العينات أو الصفوف في البيانات.
      de: Stellt die einzelnen Metriken für jede Zeile in den Daten vertikal dar und
        verknüpft sie als Linie miteinander. Dieses Diagramm ist nützlich, um mehrere
        Metriken in allen Stichproben oder Zeilen in den Daten zu vergleichen.
      es: ''
      fr: Représente les mesures individuelles pour chaque ligne de données verticalement
        et les relie par une ligne. Ce graphique est utile pour comparer plusieurs
        mesures sur l'ensemble des échantillons ou des lignes de données.
      it: ''
      ja: データの各行の個々のメトリクスを垂直にプロットし、それらを線としてリンクします。このグラフは、データ内のすべてのサンプルまたは行にわたる複数のメトリックを比較するのに役立ちます。
      ko: ''
      nl: Tekent de individuele metrieken voor elke rij in de data verticaal en verbind
        ze als een lijn. Deze grafiek is handig voor het vergelijken van meerdere
        metrieken over alle samples of rijen in de data.
      pt: ''
      pt_BR: Plota os índices individuais para cada linha nos dados verticalmente
        e os vincula como uma linha. Este gráfico é útil para comparar várias métricas
        em todas as amostras ou linhas nos dados.
      ru: ''
      sk: ''
      sl: Izriše posamezne mere za vsako vrstico podatkov navpično in jih med seboj
        poveže kot črto. Grafikon je uporaben za primerjavo več mer med vsemi vzorci
        ali vrsticami podatkov.
      tr: ''
      uk: Розраховує окремі показники для кожного рядка в даних вертикально і пов'язують
        їх як ряд. Ця діаграма корисна для порівняння декількох показників у всіх
        зразках або рядах у даних.
      zh: 垂直地绘制数据中每一行的单个指标，并将它们链接成一行。此图表用于比较数据中所有样本或行中的多个指标。
      zh_TW: 垂直地繪制數據中每一行的單個指標，並將它們链接成一行。此圖表用於比較數據中所有樣本或行中的多個指標。
    trimmed_msgid: Plots the individual metrics for each row in the data vertically
      and links them together as a line. This chart is useful for comparing multiple
