      Select` is on.
    occurances: []
    po_translations:
      ar: يتم تطبيق المسند عند جلب قيمة مميزة لتعبئة مكون التحكم في التصفية. يدعم
        صيغة قالب جينجا. لا ينطبق إلا عند تشغيل «تمكين تحديد عامل التصفية».
      de: Prädikat, das beim Abrufen eines eindeutigen Werts angewendet wird, um die
        Filtersteuerelementkomponente aufzufüllen. Unterstützt jinja-Vorlagensyntax.
        Gilt nur, wenn "Filterauswahl aktivieren" aktiviert ist.
      es: El predicado aplicado al obtener un valor distinto para rellenar el componente
        de control de filtro. Soporta la sintaxis de la plantilla jinja. Se aplica
        solo cuando `Habilitar selección de filtro` está activado.
      fr: Prédicat appliqué lors de l'extraction d'une valeur distincte pour remplir
        le composant de contrôle du filtre. Supporte la syntaxe des modèles jinja.
        Ne s'applique que lorsque l'option « Activer la sélection du filtre » est
        activée.
      it: Predicato utilizzato quando si fornisce un valore univoco per popolare il
        componente di controllo del filtro. Supporta la sintassi del template jinja.
        È utilizzabile solo quando è abilitata l'opzione "Abilita selezione filtro".
      ja: フィルター制御コンポーネントに値を設定するために個別の値をフェッチするときに適用される述語。 jinja テンプレート構文をサポートします。 「フィルター選択を有効にする」がオンの場合にのみ適用されます。
      ko: ''
      nl: Voorspelling toegepast bij het ophalen van verschillende waarde om het filter
        besturingscomponent te vullen. Ondersteunt jinja template syntax. Geldt alleen
        wanneer `Filter Selecteren inschakelen` is ingeschakeld.
      pt: Predicado aplicado ao obter um valor distinto para preencher a componente
        de controlo de filtro. Suporta a sintaxe jinja standard. Apenas se aplica
        quando "Ativar Filtro de Seleção" está ativado.
      pt_BR: Predicado aplicado quando se vai buscar um valor distinto para preencher
        o componente de controle do filtro. Suporta a sintaxe do modelo jinja. Aplica-se
        apenas quando `Ativar seleção de filtro` está ativado.
      ru: Предикат, который будет применен при получении уникальных значений фильтра.
        Поддерживает синтаксис шаблонов Jinja. Эта настройка применяется только когда
        включен параметр "Enable Filter Select".
