      ar: يقلل من عدد علامات المحور X التي سيتم عرضها. إذا كان هذا صحيحًا، فلن يتم
        تجاوز المحور السيني وقد تكون التسميات مفقودة. إذا كان الخطأ خاطئًا، فسيتم
