      de: Reduziert die Anzahl der darzustellenden X-Achsen-Ticks. Wenn WAHR, läuft
        die x-Achse nicht über und Beschriftungen fehlen möglicherweise. Wenn FALSCH,
        wird eine Mindestbreite auf Spalten angewendet und die Breite kann in einen
        horizontalen Bildlauf überlaufen.
      es: ''
      fr: Réduit le nombre de points de repère de l’axe des abscisses à afficher.
        Si la valeur est définie à True, l’axe des abscisses ne débordera pas et des
        étiquettes pourraient être manquantes. Si elle est fausse, une largeur minimale
        sera appliquée aux colonnes et la largeur pourrait déborder dans un défilement
        horizontal.
      it: ''
      ja: レンダリングされる X 軸のティック数を減らします。 true の場合、X 軸はオーバーフローせず、ラベルが欠落する可能性があります。 false
        の場合、最小幅が列に適用され、幅が水平スクロールにオーバーフローする可能性があります。
      ko: ''
      nl: Vermindert het aantal X-as tikken om gerenderd te worden. Als dit waar is,
        zal de x-as niet overstroomd worden en kunnen labels ontbreken. Indien onwaar,
        wordt een minimale breedte toegepast op kolommen en de breedte kan overlopen
        naar een horizontale scroll.
      pt: ''
      pt_BR: Reduz o número de ticks do eixo X a serem processados. Se verdadeiro,
        o eixo X não transbordará e os rótulos podem estar ausentes. Se falso, será
        aplicada uma largura mínima às colunas e a largura pode transbordar para um
        deslocamento horizontal.
      ru: Уменьшить количество отрисованных делений на оси X. Если флажок установлен,
        некоторые метки могут оказаться скрыты.
      sk: ''
      sl: Zmanjša število izrisanih oznak na X-osi. Če je vklopljeno, se x-os ne bo
        prelila in lahko oznake manjkajo. Če je izklopljeno, bo upoštevana min. širina
        stolpcev, ki pa se lahko prelije v horizontalni drsnik.
      tr: ''
      uk: Зменшує кількість кліщів осі, які потрібно надати. Якщо це правда, осі x
        не переповнюється, а мітки можуть відсутні. Якщо помилково, до стовпців буде
        застосовано мінімальна ширина, а ширина може переливатися в горизонтальний
        сувій.
      zh: 减少要渲染的X轴标记数。如果为true，x轴将不会溢出，但是标签可能丢失。如果为false，则对列应用最小宽度，宽度可能溢出到水平滚动条中。
      zh_TW: 減少要渲染的 X 軸標記數。如果為 true，x 軸將不會溢出，但是標籤可能丢失。如果為 false，则對列應用最小寬度，寬度可能溢出到水平滚動條中。
