    msgid: Regular filters add where clauses to queries if a user belongs to a role
      referenced in the filter, base filters apply filters to all queries except the
      roles defined in the filter, and can be used to define what users can see if
      no RLS filters within a filter group apply to them.
    occurances: []
    po_translations:
      ar: تضيف عوامل التصفية العادية عبارات المكان إلى الاستعلامات إذا كان المستخدم
        ينتمي إلى دور مشار إليه في عامل التصفية، وتطبق عوامل التصفية الأساسية عوامل
        التصفية على جميع الاستعلامات باستثناء الأدوار المحددة في عامل التصفية، ويمكن
        استخدامها لتحديد ما يمكن للمستخدمين رؤيته في حالة عدم تطبيق عوامل تصفية RLS
        داخل مجموعة عوامل التصفية عليهم.
      de: Reguläre Filter fügen Abfragen WHERE-Ausrücke hinzu, falls ein*e Benutzer*in
        einer im Filter referenzierten Rolle angehört. Basisfilter wenden Filter auf
        alle Abfragen mit Ausnahme der im Filter definierten Rollen an. Über sie lässt
        sich definieren, was Benutzer*innen sehen können, wenn auf sie keine RLS-Filter
        angewendet werden.
      es: ''
      fr: Les filtres réguliers ajoutent des clauses WHERE aux requêtes si un·e utilisateur·rice
        appartient à un profil référencé dans le filtre. Les filtres de base appliquent
        les filtres à toutes les requêtes sauf pour les profils définis dans le filtre,
        et peuvent être utilisés pour définir ce que les utilisateur·rice·s peuvent
        voir si aucun filtre RLS au sein d'un groupe de filtres ne s'appliquent à
        eux.
      it: ''
      ja: 通常のフィルタは、フィルタで参照されるロールにユーザーが属している場合にクエリに where 句を追加します。ベース フィルタは、フィルタで定義されたロールを除くすべてのクエリにフィルタを適用します。また、RLS
        フィルタがない場合にユーザーが表示できる内容を定義するために使用できます。
      ko: ''
      nl: Normale filters voegen "where" clausules toe voor zoekopdrachten als een
        gebruiker deel uitmaakt van een rol waarnaar wordt verwezen in het filter,
        basisfilters passen filters toe op alle zoekopdrachten, behalve de rollen
        die gedefinieerd zijn in het filter, en kan worden gebruikt om te bepalen
        wat gebruikers kunnen zien als er geen RLB-filters binnen een filtergroep
        op hen van toepassing zijn.
      pt: ''
      pt_BR: Os filtros regulares adicionam cláusulas WHERE às consultas se um utilizador
        pertencer a uma função referenciada no filtro. Os filtros de base aplicam
        filtros a todas as consultas, excepto às funções definidas no filtro, e podem
        ser utilizados para definir o que os utilizadores podem ver se nenhum filtro
        RLS dentro de um grupo de filtros se aplicar a eles.
      ru: Обычные фильтры добавляют операторы where к запросам, если пользователь
        принадлежит к роли, на которую ссылается фильтр. Базовые фильтры применяют
        фильтры ко всем запросам, кроме ролей, определенных в фильтре, и могут использоваться
        для определения того, что пользователи могут видеть, если к ним не применяются
        фильтры RLS в группе фильтров.
      sk: ''
      sl: Navadni filtri dodajo WHERE stavek v poizvedbe, če ima uporabnik vlogo podano
        v filtru. Osnovni filtri filtrirajo vse poizvedbe, razen vlog, definiranih
        v filtru, in jih je mogoče uporabiti za nastavitev tega kaj uporabnik vidi,
        če v skupini filtrov ni RLS-filtrov, ki bi se nanašali nanje.
      tr: ''
      uk: Регулярні фільтри додають, де до запитів, якщо користувач належить до ролі,
        що посилається у фільтрі, базові фільтри застосовують фільтри до всіх запитів,
        крім ролей, визначених у фільтрі, і можуть бути використані для визначення
        того, що користувачі можуть побачити, чи немає фільтрів RLS у межах a Група
        фільтрів застосовується до них.
      zh: 如果用户属于过滤器中引用的角色，常规过滤器会向查询添加WHERE子句；基础过滤器则对所有查询应用过滤条件，除了过滤器中定义的角色之外。如果在过滤器组内没有适用于用户的行级安全（RLS）过滤器，基础过滤器可以用来定义用户能够看到的内容。
      zh_TW: 如果用戶属於過濾器中引用的角色，常規過濾器會向查詢增加 WHERE 子句；基礎過濾器则對所有查詢應用過濾條件，除了過濾器中定義的角色之外。如果在過濾器組内没有適用於用戶的行級安全（RLS）過濾器，基礎過濾器可以用來定義用戶能够看到的内容。
    trimmed_msgid: Regular filters add where clauses to queries if a user belongs
      to a role referenced in the filter, base filters apply filters to all queries
      except the roles defined in the filter, and can be used to define what users
      can see if no RLS filters within a filter group apply to them.
