      it: ''
      ja: ロールは、ダッシュボードへのアクセスを定義するリストです。ロールにダッシュボードへのアクセスを許可すると、データセット レベルのチェックがバイパスされます。ロールが定義されていない場合は、通常のアクセス許可が適用されます。
