  ? 'SQL Lab uses your browser''s local storage to store queries and results.

    Currently, you are using %(currentUsage)s KB out of %(maxStorage)d KB storage
    space.

    To keep SQL Lab from crashing, please delete some query tabs.

    You can re-access these queries by using the Save feature before you delete the
    tab.

    Note that you will need to close other SQL Lab windows before you do this.'
  : ai_translations: {}
    metadata: {}
    msgid: 'SQL Lab uses your browser''s local storage to store queries and results.

      Currently, you are using %(currentUsage)s KB out of %(maxStorage)d KB storage
      space.

      To keep SQL Lab from crashing, please delete some query tabs.

      You can re-access these queries by using the Save feature before you delete
      the tab.

      Note that you will need to close other SQL Lab windows before you do this.'
    occurances: []
    po_translations:
      ar: 'يستخدم SQL Lab التخزين المحلي للمتصفح لتخزين الاستعلامات والنتائج.

        حاليًا، تستخدم %(currentUsage)s KB خارج مساحة تخزين %(maxStorage)d KB.

        لمنع SQL Lab من التعطل، يرجى حذف بعض علامات تبويب الاستعلام.

        يمكنك إعادة الوصول إلى هذه الاستعلامات باستخدام ميزة الحفظ قبل حذف علامة التبويب.

        لاحظ أنك ستحتاج إلى إغلاق نوافذ SQL Lab الأخرى قبل القيام بذلك.'
      de: 'SQL Lab verwendet den lokalen Speicher Ihres Browsers, um Abfragen und
        Ergebnisse zu speichern.

        Derzeit verwenden Sie %(currentUsage)s KB von %(maxStorage)d KB Speicherplatz.

        Um zu verhindern, dass SQL Lab abstürzt, löschen Sie einige Abfrageregisterkarten.

        Sie können erneut auf diese Abfragen zugreifen, indem Sie die Funktion Speichern
        verwenden, bevor Sie die Registerkarte löschen.

        Beachten Sie, dass Sie andere SQL Lab-Fenster schließen müssen, bevor Sie
        dies tun.'
      es: ''
      fr: SQL Lab utilise le stockage local de votre navigateur pour stocker les requêtes
        et les résultats. Actuellement, vous utilisez %(currentUsage)s ko sur %(maxStorage)d
        ko à partir de l’espace de stockage. Pour éviter que SQL Lab ne tombe en panne,
        veuillez supprimer certains onglets de requête. Vous pouvez accéder à nouveau
        à ces requêtes en utilisant la fonction Enregistrer avant de supprimer l’onglet.
        Veuillez noter que vous devrez fermer les autres fenêtres de SQL Lab avant
        de le faire.
      it: ''
      ja: 'SQL Lab はブラウザのローカル ストレージを使用してクエリと結果を保存します。

        現在、%(maxStorage)d KB のストレージ スペースのうち %(currentUsage)s KB を使用しています。

        SQL Lab がクラッシュしないようにするには、一部のクエリを削除してください。 '
      ko: ''
      nl: 'SQL Lab gebruikt de lokale opslag van je browser om query''s en resultaten
        op te slaan.

        Momenteel gebruikt u een opslagruimte %(currentUsage)s KB van %(maxStorage)d
        KB.

        Om te voorkomen dat SQL Lab crasht, verwijder een aantal query tabbladen.

        U kunt deze zoekopdrachten heropenen met behulp van de ''Opslaan'' functie
        voordat u het tabblad verwijdert.

        Merk op dat u andere SQL Lab vensters moet sluiten voordat u dit doet.'
      pt: ''
      pt_BR: 'O SQL Lab usa seu armazenamento local do navegador para armazenar consultas
        e resultados.

        Atualmente, você está usando %(currentUsage)s KB de %(maxStorage)d KB de armazenamento
        espaço.

        Para evitar que o SQL Lab falhe, elimine algumas abas de consulta.

        Pode voltar a essas consultas utilizando a funcionalidade Salvar antes de
        eliminar a aba.

        Observe que terá de fechar outras janelas do SQL Lab antes de fazer isso.'
      ru: 'SQL Lab использует локальное хранилище вашего браузера для хранения запросов
        и результатов.

        В настоящее время вы используете %(currentUsage)s КБ из %(maxStorage)d КБ
        дискового пространства.

        Чтобы предотвратить сбой SQL Lab, пожалуйста, удалите некоторые вкладки запросов.

        Вы можете повторно получить доступ к этим запросам, используя функцию сохранения
        перед удалением вкладки.

        Обратите внимание, что перед этим вам нужно будет закрыть другие окна SQL
        Lab.'
      sk: ''
      sl: 'SQL laboratorij uporablja lokalno shrambo brskalnika za shranjevanje poizvedb
        in rezultatov.

        Trenutno uporabljate %(currentUsage)s KB od %(maxStorage)d KB prostora.

        Da preprečite sesutje SQL laba, izbrišite nekaj zavihkov s poizvedbami.

        Poizvedbe lahko ponovno pridobite, če pred brisanjem uporabite funkcijo Shrani.

        Pred tem morate zapreti druga okna SQL laboratorija.'
      tr: ''
      uk: 'SQL Lab використовує місцеве сховище вашого браузера для зберігання запитів
        та результатів.

        В даний час ви використовуєте %(currentUsage)s KB з %(maxStorage)d KB зберігання.

        Щоб не зійти в лабораторію SQL, будь ласка, видаліть кілька вкладок запитів.

        Ви можете повторно отримати ці запити, використовуючи функцію збереження,
        перш ніж видалити вкладку.

        Зауважте, що вам потрібно буде закрити інші вікна лабораторії SQL, перш ніж
        це зробити.'
      zh: SQL Lab 将查询和结果数据存储在浏览器的本地存储中。目前，您已使用了 %(currentUsage)s KB，总共可用 %(maxStorage)d
        KB 存储空间。为了防止 SQL Lab 崩溃，请删除一些查询选项卡。在删除选项卡之前，您可以通过使用保存功能来重新访问这些查询。请注意，在执行此操作之前，您需要关闭其他的
        SQL Lab 窗口。
      zh_TW: SQL Lab 將查詢和结果數據儲存在瀏覽器的本地儲存中。目前，您已使用了 %(currentUsage)s KB，總共可用 %(maxStorage)d
        KB 儲存空間。為了防止 SQL Lab 崩溃，請删除一些查詢選項卡。在删除選項卡之前，您可以通過使用保存功能來重新訪問這些查詢。請注意，在執行此操作之前，您需要關闭其他的
        SQL Lab 窗口。
    trimmed_msgid: 'SQL Lab uses your browser''s local storage to store queries and
      results.

      Currently, you are using %(currentUsage)s KB out of %(maxStorage)d KB storage
      space.

      To keep SQL Lab from crashing, please delete some query tabs.

      You can re-access these queries by using the Save feature before you delete
      the tab.

      Note that you will need to close other SQL Lab windows before you do this.'
