  : ai_translations: {}
    metadata: {}
    msgid: Select one or many metrics to display, that will be displayed in the percentages
      of total. Percentage metrics will be calculated only from data within the row
      limit. You can use an aggregation function on a column or write custom SQL to
      create a percentage metric.
    occurances: []
    po_translations:
      ar: حدد مقياسًا واحدًا أو عدة مقاييس لعرضها، وسيتم عرضها بالنسب المئوية للإجمالي.
        سيتم حساب مقاييس النسبة المئوية فقط من البيانات الموجودة ضمن حد الصف. يمكنك
        استخدام وظيفة التجميع على عمود أو كتابة SQL مخصص لإنشاء مقياس النسبة المئوية.
      de: ''
      es: ''
      fr: ''
      it: ''
      ja: 表示する 1 つまたは複数のメトリックを選択します。合計に対するパーセンテージで表示されます。パーセンテージ メトリックは、行制限内のデータのみから計算されます。列に対して集計関数を使用するか、カスタム
        SQL を作成してパーセンテージ メトリックを作成できます。
      ko: ''
      nl: Selecteer een of meerdere metrieken om weer te geven, die worden weergegeven
        in de percentages van het totaal. Percentage metrieken worden alleen berekend
        op basis van gegevens binnen de rij limiet. U kunt een aggregatie functie
        gebruiken op een kolom of aangepaste SQL schrijven om een percentage te maken.
      pt: ''
      pt_BR: ''
      ru: Выберите одну или несколько мер, чтобы отобразить их в доле от итого. Процентные
        меры будут вычислены только на основе данных, уместившихся в лимит строк.
        Чтобы создать меру, также можно использовать агрегатную функцию или написать
        свой SQL.
      sk: ''
      sl: Izberite eno ali več mer za prikaz kot procent celote. Procentualna mera
