  ? Select the charts to which you want to apply cross-filters in this dashboard.
    Deselecting a chart will exclude it from being filtered when applying cross-filters
    from any chart on the dashboard. You can select "All charts" to apply cross-filters
    to all charts that use the same dataset or contain the same column name in the
    dashboard.
  : ai_translations: {}
    metadata: {}
    msgid: Select the charts to which you want to apply cross-filters in this dashboard.
      Deselecting a chart will exclude it from being filtered when applying cross-filters
      from any chart on the dashboard. You can select "All charts" to apply cross-filters
      to all charts that use the same dataset or contain the same column name in the
      dashboard.
    occurances: []
    po_translations:
      ar: حدد المخططات التي تريد تطبيق الفلاتر المتقاطعة عليها في لوحة المعلومات هذه.
        سيؤدي إلغاء تحديد المخطط إلى استبعاده من التصفية عند تطبيق عوامل التصفية المتقاطعة
        من أي مخطط على لوحة المعلومات. يمكنك تحديد «جميع المخططات» لتطبيق الفلاتر
        المتقاطعة على جميع المخططات التي تستخدم نفس مجموعة البيانات أو تحتوي على نفس
        اسم العمود في لوحة المعلومات.
      de: ''
      es: ''
      fr: Sélectionnez les graphiques auxquels vous souhaitez appliquer des filtres
        croisés dans ce tableau de bord. Si vous désélectionnez un graphique, il ne
        sera pas filtré lors de l'application de filtres croisés à partir de n'importe
        quel graphique du tableau de bord. Vous pouvez sélectionner « Tous les graphiques »
        pour appliquer des filtres croisés à tous les graphiques qui utilisent le
        même ensemble de données ou contiennent le même nom de colonne dans le tableau
        de bord.
      it: ''
      ja: このダッシュボードでクロスフィルターを適用するグラフを選択します。グラフの選択を解除すると、ダッシュボード上のグラフからクロスフィルターを適用するときに、そのグラフがフィルターの対象から除外されます。
        「すべてのチャート」を選択すると、ダッシュボード内の同じデータセットを使用するか、同じ列名を含むすべてのチャートにクロスフィルターを適用できます。
      ko: ''
      nl: Selecteer de grafieken waaraan je cross-filters wilt toepassen in dit dashboard.
        Het deselecteren van een grafiek zal ervoor zorgen dat het niet gefilterd
        wordt bij het toepassen van cross-filters in elke grafiek op het dashboard.
        Je kunt "Alle grafieken" selecteren om cross-filters toe te passen op alle
        grafieken die dezelfde dataset gebruiken of dezelfde kolomnaam op het dashboard
        bevatten.
      pt: ''
      pt_BR: ''
      ru: Выберите все диаграммы, к которым вы хотите применить кросс-фильтрацию.
        Вы можете выбрать вариант "Все диаграммы", чтобы применить кросс-фильтрацию
        ко всем диаграммам, связанным с одним и тем же датасетом или содержащим одинаковое
        название столбца.
      sk: ''
      sl: Izberite grafikone, za katere želite uporabiti medsebojne filtre v tej nadzorni
        plošči. Odstranitev grafikona bo izključila medsebojno filtriranje s kateregakoli
        grafikona na nadzorni plošči. Izberete lahko "Vsi grafikoni", da uporabite
        medsebojne filtre za vse grafikone, ki uporabljajo isti podatkovni niz ali
        vsebujejo stolpec z enakim nazivom.
      tr: ''
      uk: Виберіть діаграми, до яких потрібно застосувати перехресні фільтри на цій
        інформаційній панелі. Скасування діаграми виключає її з фільтрування при застосуванні
        перехресних фільтрів з будь-якої діаграми на приладовій панелі. Ви можете
        вибрати "всі діаграми", щоб застосувати перехресні фільтри до всіх діаграм,
        які використовують один і той же набір даних, або містять одне і те ж ім'я
        стовпця на інформаційній панелі.
      zh: 选择您希望在此看板上应用交叉筛选的图表。取消选择一个图表将在从看板上的任何图表应用交叉筛选时排除它。您可以选择“所有图表”，以对使用相同数据集或在看板中包含相同列名的所有图表应用交叉筛选。
      zh_TW: 選擇您希望在此看板上應用交叉篩選的圖表。取消選擇一個圖表將在從看板上的任何圖表應用交叉篩選時排除它。您可以選擇“所有圖表”，以對使用相同數據集或在看板中包含相同列名的所有圖表應用交叉篩選。
    trimmed_msgid: Select the charts to which you want to apply cross-filters in this
      dashboard. Deselecting a chart will exclude it from being filtered when applying
      cross-filters from any chart on the dashboard. You can select "All charts" to
      apply cross-filters to all charts that use the same dataset or contain the same
      column name in the dashboard.
