    metadata: {}
    msgid: Showcases a single metric front-and-center. Big number is best used to
      call attention to a KPI or the one thing you want your audience to focus on.
    occurances: []
    po_translations:
      ar: يعرض مقياسًا واحدًا في الأمام والوسط. يُفضل استخدام الرقم الكبير لجذب الانتباه
        إلى KPI أو الشيء الوحيد الذي تريد أن يركز عليه جمهورك.
      de: Zeigt eine einzelne Metrik im Vordergrund. ‚Große Zahl‘ wird am besten verwendet,
        um die Aufmerksamkeit auf einen KPI oder die eine Information zu lenken, auf
        die sich Ihr Publikum konzentrieren soll.
      es: ''
      fr: Présente une seule mesure au premier plan. Il est préférable d’utiliser
        un grand chiffre pour attirer l’attention sur un ICR ou sur la chose sur laquelle
        vous voulez que votre public se concentre.
      it: ''
      ja: 単一のメトリックを前面と中央に表示します。大きな数字は、KPI や視聴者に注目してもらいたい 1 つの事柄への注意を喚起するために使用するのが最適です。
