  : ai_translations: {}
    metadata: {}
    msgid: Stepped-line graph (also called step chart) is a variation of line chart
      but with the line forming a series of steps between data points. A step chart
      can be useful when you want to show the changes that occur at irregular intervals.
    occurances: []
    po_translations:
      ar: الرسم البياني للخط المتدرج (يسمى أيضًا مخطط الخطوة) هو شكل مختلف من المخطط
        الخطي ولكن مع الخط الذي يشكل سلسلة من الخطوات بين نقاط البيانات. يمكن أن يكون
        المخطط التدريجي مفيدًا عندما تريد عرض التغييرات التي تحدث على فترات غير منتظمة.
      de: Zeitreihen-Stufenliniendiagramm (auch Schrittdiagramm genannt) ist eine
        Variation des Liniendiagramms, wobei die Linie jedoch eine Reihe von Schritten
        zwischen Datenpunkten bildet. Ein Schrittdiagramm kann nützlich sein, wenn
        Sie die Änderungen anzeigen möchten, die in unregelmäßigen Abständen auftreten.
      es: Gráfico de Series por tiempo en Pasos (conocida como Tabla de Pasos) es
        una variación del gráfico de Linea, en la cual la linea que forma la serie
        de tiempo forma una serie de 'pasos' entre los puntos de intervalos de datos.
        Una tabla de paso es útil cuando se quieren mostrar los cambios ocurridos
        en intervalos regulares.
      fr: Le graphique à lignes en escalier (également appelé graphique à étapes)
        est une variation du graphique linéaire, mais la ligne formant une série d’étapes
        entre les points de données. Un tableau des étapes peut être utile lorsque
        vous voulez afficher les changements qui se produisent à des intervalles irréguliers.
      it: ''
      ja: 階段状折れ線グラフ (ステップ チャートとも呼ばれる) は折れ線グラフのバリエーションですが、線がデータ ポイント間に一連のステップを形成します。ステップ
        チャートは、不規則な間隔で発生する変化を表示する場合に便利です。
      ko: ''
      nl: Getrapte lijngrafiek (ook wel stappendiagram genoemd) is een variatie van
        lijndiagram, maar met de lijn vormen een reeks stappen tussen datapunten.
        Een stappendiagram kan handig zijn als je veranderingen wilt laten zien die
        met onregelmatige tussenpozen optreden.
      pt: ''
      pt_BR: O gráfico de linhas escalonadas (também designado por gráfico de passos)
        é uma variação do gráfico de linhas, mas com a linha a formar uma série de
        passos entre os pontos de dados. Um gráfico escalonado pode ser útil quando
        se pretende mostrar as alterações que ocorrem em intervalos irregulares.
      ru: Ступенчатый график представляет данные в виде серии ступенек от точки к
        точке. Может быть полезным, когда вы хотите показать изменения, происходящие
        нерегулярно.
      sk: ''
      sl: Stopničasti grafikon je izpeljanka črtnega grafikona, pri čemer krivuljo
        tvorijo stopnice med posameznimi točkami. Koristen je za prikaz sprememb na
        posameznih intervalih.
      tr: ''
      uk: Графік ступінчастої лінії (також називається крок діаграми)-це варіація
        лінійної діаграми, але з лінією, що утворює ряд кроків між точками даних.
        Крок діаграми може бути корисною, коли ви хочете показати зміни, які відбуваються
        з нерегулярними інтервалами.
      zh: “时间序列步进折线图（也称为步进图）是折线图的一种变体，但线条在数据点之间形成一系列步进。当您希望显示不规则间隔发生的变化时，步进图可能很有用。”
      zh_TW: “時間序列步進折線圖（也稱為步進圖）是折線圖的一種變體，但線條在數據點之間形成一系列步進。當您希望顯示不規則間隔發生的變化時，步進圖可能很有用。”
    trimmed_msgid: Stepped-line graph (also called step chart) is a variation of line
      chart but with the line forming a series of steps between data points. A step
      chart can be useful when you want to show the changes that occur at irregular
      intervals.
