    msgid: Swiss army knife for visualizing data. Choose between step, line, scatter,
      and bar charts. This viz type has many customization options as well.
    occurances: []
    po_translations:
      ar: سكين الجيش السويسري لتصور البيانات. اختر بين المخططات المتدرجة والخطية والمبعثرة
        والشريطية. يحتوي هذا النوع من viz على العديد من خيارات التخصيص أيضًا.
      de: Schweizer Taschenmesser zur Visualisierung von Daten. Wählen Sie zwischen
        Schritt-, Linien-, Punkt- und Balkendiagrammen. Dieser Visualisierungstyp
        hat auch viele Anpassungsoptionen.
      es: ''
      fr: Couteau suisse pour la visualisation des données. Vous avez le choix entre
        des diagrammes en escalier, des diagrammes linéaires, des diagrammes de dispersion
        et des diagrammes à barres. Ce type d'affichage dispose également de nombreuses
        options de personnalisation.
      it: ''
      ja: データを視覚化するためのスイスアーミーナイフ。ステップ チャート、折れ線グラフ、散布図、棒グラフから選択します。この Viz タイプには多くのカスタマイズ
        オプションもあります。
      ko: ''
      nl: Het Zwitserse zakmes voor het visualiseren van gegevens. Kies tussen stap,
        lijn, verspreidings en staafdiagrammen. Dit viz type heeft ook veel aanpassingsmogelijkheden.
      pt: ''
      pt_BR: Canivete suíço para visualizar dados. Escolha entre gráficos de etapas,
        de linhas, de dispersão e de barras. Esse tipo de visualização também tem
        muitas opções de personalização.
      ru: Швейцарский нож визуализации данных. Выбирайте между шаговой диаграммой,
        графиком, ступенчатым графиком и гистограммой. В этой диаграмме есть множество
        настроек.
      sk: ''
      sl: Univerzalni grafikon za vizualizacijo podatkov. Izbirajte med stopničastimi,
        črtnimi, raztresenimi in stolpčnimi grafikoni. Grafikon ima širok nabor prilagoditev.
      tr: ''
      uk: Швейцарський армійський ніж для візуалізації даних. Виберіть між крок, рядками,
        розсіюванням та штрихами. Цей тип Viz також має багато варіантів налаштування.
