  ? The CTAS (create table as select) doesn't have a SELECT statement at the end.
    Please make sure your query has a SELECT as its last statement. Then, try running
    your query again.
  : ai_translations: {}
    metadata: {}
    msgid: The CTAS (create table as select) doesn't have a SELECT statement at the
      end. Please make sure your query has a SELECT as its last statement. Then, try
      running your query again.
    occurances: []
    po_translations:
      ar: لا يحتوي CTAS (إنشاء جدول على النحو المحدد) على عبارة SELECT في النهاية.
        يرجى التأكد من أن الاستعلام الخاص بك يحتوي على SELECT باعتباره البيان الأخير.
        ثم حاول تشغيل الاستعلام مرة أخرى.
      de: CTAS (create table as select) kann nur mit einer Abfrage ausgeführt werden,
        bei der die letzte Anweisung ein SELECT ist. Bitte stellen Sie sicher, dass
        Ihre Abfrage eine SELECT-Anweisung als letzte Anweisung hat. Versuchen Sie
        dann erneut, die Abfrage auszuführen.
      es: ''
      fr: La requête CTAS (create table as select) ne comporte pas d'instruction SELECT
        à la fin. Assurez-vous que votre requête comporte une instruction SELECT à
        la fin. Ensuite, essayez d'exécuter à nouveau votre requête.
      it: ''
      ja: CTAS (選択としてテーブルを作成) には、最後に SELECT ステートメントがありません。クエリの最後のステートメントとして SELECT
        が含まれていることを確認してください。次に、クエリを再度実行してみます。
      ko: ''
      nl: De CTAS (create table as select) heeft geen SELECT instructie aan het einde.
        Zorg ervoor dat uw query als laatste verklaring een SELECT heeft. Probeer
        vervolgens uw zoekopdracht opnieuw uit te voeren.
      pt: ''
      pt_BR: O CTAS (create table as select) não tem uma instrução SELECT no final.
        Certifique-se de que sua consulta tenha um SELECT como última instrução. Em
        seguida, tente executar sua consulta novamente.
      ru: CTAS (CREATE TABLE AS SELECT) не содержит SELECT в конце. Проверьте запрос
        и попробуйте повторно выполнить его.
      sk: ''
      sl: CTAS (create table as select) na koncu nima SELECT stavka. Poskrbite, da
        bo v poizvedbi SELECT zadnji stavek. Potem ponovno poženite poizvedbo.
      tr: ''
      uk: CTA (створити таблицю як Select) не має оператора SELECT в кінці. Будь ласка,
        переконайтеся, що ваш запит має вибір як останнє твердження. Потім спробуйте
        знову запустити свій запит.
      zh: CTA（create table as select）只能与最后一条语句为SELECT的查询一起运行。请确保查询的最后一个语句是SELECT。然后再次尝试运行查询。
      zh_TW: CTA（create table as select）只能與最後一條語句為 SELECT 的查詢一起運行。請確保查詢的最後一個語句是 SELECT。然後再次嘗試運行查詢。
    trimmed_msgid: The CTAS (create table as select) doesn't have a SELECT statement
      at the end. Please make sure your query has a SELECT as its last statement.
      Then, try running your query again.
