    \ chart type instead."
  : ai_translations: {}
    metadata: {}
    msgid: "The classic. Great for showing how much of a company each investor gets,\
      \ what demographics follow your blog, or what portion of the budget goes to\
      \ the military industrial complex.\n\n        Pie charts can be difficult to\
      \ interpret precisely. If clarity of relative proportion is important, consider\
      \ using a bar or other chart type instead."
    occurances: []
    po_translations:
      ar: "الكلاسيكية. رائع لإظهار مقدار الشركة التي يحصل عليها كل مستثمر، أو التركيبة\
        \ السكانية التي تتبع مدونتك، أو أي جزء من الميزانية يذهب إلى المجمع الصناعي\
        \ العسكري.\n\n قد يكون من الصعب تفسير المخططات الدائرية بدقة. إذا كان وضوح\
        \ النسبة النسبية مهمًا، ففكر في استخدام شريط أو نوع مخطط آخر بدلاً من ذلك."
      de: 'Der Klassiker. Großartig, um zu zeigen, wie viel von einem Unternehmen
        jeder Investor bekommt, welche Demografie Ihrem Blog folgt oder welcher Teil
        des Budgets in den militärisch-industriellen Komplex fließt.


        Kreisdiagramme können schwierig zu interpretieren sein. Wenn die Klarheit
        des relativen Anteils wichtig ist, sollten Sie stattdessen die Verwendung
        eines Balkens oder eines anderen Diagrammtyps in Betracht ziehen.'
      es: ''
      fr: Le classique. Il est idéal pour montrer la part de chaque investisseur dans
        la société, les groupes démographiques qui suivent votre blog ou la part du
        budget allouée au complexe militaro-industriel.        Les diagrammes circulaires
        peuvent être difficiles à interpréter avec précision. Si la clarté des proportions
        relatives est importante, envisagez plutôt d'utiliser un diagramme à barres
        ou un autre type de diagramme.
      it: ''
      ja: "クラシック。各投資家が会社の株式をどれだけ取得するか、どのような層がブログをフォローしているか、予算のどの部分が軍産複合体に使われるかを示すのに最適です。\n\
        \n        円グラフを正確に解釈するのは難しい場合があります。相対的な比率を明確にすることが重要な場合は、代わりに棒グラフまたは他の種類のグラフを使用することを検討してください。"
      ko: ''
      nl: "De klassieker. Ideaal om te laten zien hoeveel van een bedrijf elke belegger\
        \ krijgt, welke demografie uw blog volgt, of welk deel van de begroting gaat\
        \ naar het militaire industriële complex.\n\n        Cirkeldiagrammen kunnen\
        \ moeilijk te interpreteren zijn. Als de helderheid van relatieve verhoudingen\
        \ belangrijk is, kun je in plaats daarvan een staaf- of ander grafiektype\
        \ gebruiken."
      pt: ''
      pt_BR: "O clássico. Ótimo para mostrar quanto de uma empresa cada investidor\
