    msgid: "The dataset configuration exposed here\n                affects all the\
      \ charts using this dataset.\n                Be mindful that changing settings\n\
      \                here may affect other charts\n                in undesirable\
      \ ways."
    occurances: []
    po_translations:
      ar: "تم عرض تكوين مجموعة البيانات هنا\n يؤثر على جميع المخططات التي تستخدم مجموعة\
        \ البيانات هذه.\n ضع في اعتبارك أن تغيير الإعدادات\n هنا قد تؤثر على الرسوم\
        \ البيانية الأخرى\n بطرق غير مرغوب فيها."
      de: "Die hier verfügbar gemachte Datensatzkonfiguration\n                wirkt\
        \ sich auf alle Diagramme aus, die diesen Datensatz verwenden.\n         \
        \       Achten Sie darauf, dass das hier vorgenommene Einstellungs-\n    \
        \            änderungen sich in unerwünschter Weise\n                auf andere\
        \ Diagramme auswirken können."
      es: ''
      fr: La configuration du jeu de donnée indiqué ici                s'applique
        à tous les graphiques utilisant ce ensemble de données.                Rappelez
        vous que changer ces paramètres                peut affecter d'autres graphiques                de
        manière non voulue.
      it: ''
      ja: "ここで公開されるデータセット構成は、\n このデータセットを使用するすべてのグラフに影響します。\n ここで設定を変更すると、\n 他のグラフに望ましくない影響を与える可能性があることに注意してください。"
      ko: ''
      nl: "De dataset configuratie die hier wordt getoond\n                heeft invloed\
        \ op alle grafieken die deze dataset gebruiken.\n                Wees je ervan\
        \ bewust dat het veranderen van instellingen\n                hier invloed\
        \ kan hebben op andere grafieken\n                op ongewenste manieren."
      pt: ''
      pt_BR: "A configuração do conjunto de dados exposta aqui afeta todos os gráficos\
        \ que usam esse conjunto de dados.\n Tenha em mente que alterar as configurações\n\
        \ aqui pode afetar outros gráficos \n de maneiras indesejáveis."
      ru: "Представленная здесь конфигурация датасета\n                влияет на все\
        \ диаграммы, использующие этот датасет.\n                Помните, что изменение\
        \ настроек\n                может повлиять неожиданным образом\n         \
        \       на другие диаграммы."
      sk: ''
      sl: "Tukaj prikazane nastavitve podatkovnega seta\n                vplivajo\
        \ na vse grafikone, ki uporabljajo\n                ta podatkovni set. Spreminjanje\n\
        \                nastavitev lahko nezaželeno vpliva\n                na druge\
        \ grafikone."
      tr: ''
      uk: "Конфігурація набору даних, викрита тут\n                впливає на всі\
        \ діаграми за допомогою цього набору даних.\n                Пам’ятайте, що\
        \ зміна налаштувань\n                Тут може вплинути на інші діаграми\n\
        \                небажаними способами."
      zh: 这里公开的数据集配置会影响使用此数据集的所有图表。请注意，更改此处的设置可能会以未预想的方式影响其他图表。
