    occurances: []
    po_translations:
      ar: قائمة المخططات المرتبطة بهذا الجدول. من خلال تغيير مصدر البيانات هذا، يمكنك
        تغيير طريقة عمل هذه المخططات المرتبطة. لاحظ أيضًا أن المخططات تحتاج إلى الإشارة
        إلى مصدر بيانات، لذلك سيفشل هذا النموذج في الحفظ في حالة إزالة المخططات من
