      de: Die Liste der Diagramme, die dieser Tabelle zugeordnet sind. Durch Ändern
        dieser Datenquelle können Sie das Verhalten der zugeordneten Diagramme ändern.
        Beachten Sie auch, dass Diagramme auf eine Datenquelle verweisen müssen, sodass
        dieses Formular beim Speichern fehlschlägt, wenn Diagramme aus einer Datenquelle
        entfernt werden. Wenn Sie die Datenquelle für ein Diagramm ändern möchten,
        überschreiben Sie das Diagramm aus der "Explore-Ansicht".
      es: ''
      fr: La liste des graphiques associés à ce tableau. En modifiant cette source
        de données, vous pouvez changer le comportement des graphiques associés. Notez
        également que les graphiques doivent pointer vers une source de données, de
        sorte que ce formulaire échouera lors de l'enregistrement si vous supprimez
        des graphiques d'une source de données. Si vous souhaitez modifier la source
        de données d'un graphique, écrasez le graphique de la « vue d'exploration »
      it: Elenco delle slice associate a questa tabella. Modificando questa origine
        dati, è possibile modificare le modalità di comportamento delle slice associate.
        Inoltre, va tenuto presente che le slice devono indicare un'origine dati,
        pertanto questo modulo non registra le impostazioni qualora si modifica un'origine
        dati. Se vuoi modificare l'origine dati per una slide, devi sovrascriverla
        dal 'vista di esplorazione'
      ja: このテーブルに関連付けられているグラフのリスト。このデータソースを変更すると、これらの関連するグラフの動作が変更される場合があります。また、グラフはデータソースを指す必要があるため、データソースからグラフを削除するとこのフォームの保存に失敗することにも注意してください。グラフのデータソースを変更したい場合は、「探索ビュー」からグラフを上書きします。
      ko: ''
      nl: De lijst met grafieken die gekoppeld zijn aan deze tabel. Door het wijzijgen
        van deze gegevensbron kan je aanpassen maken hoe deze bijbehorende grafieken
        zich gedragen. Houd er ook rekening mee dat grafieken naar een gegevensbron
        moeten wijzen, dus dit formulier zal niet opgeslagen kunnen worden bij het
        verwijderen van grafieken uit een gegevensbron. Als je de gegevensbron voor
        een grafiek wilt wijzigen, overschrijf je de grafiek van de 'verken weergave'
      pt: A lista de visualizações associadas a esta tabela. Ao alterar a origem de
        dados, o comportamento das visualizações associadas poderá ser alterado. Observe
        também que as visualizações tem que apontar para uma origem de dados, este
        formulário falhará na poupança se forem removidas visualizações da origem
        de dados. Se quiser alterar a origem de dados de uma visualização, atualize
        a visualização na "vista de exploração"
      pt_BR: A lista de gráficos associados a esta tabela. Ao alterar esta fonte de
        dados, pode alterar o comportamento dos gráficos associados. Tenha também
        em atenção que os gráficos têm de apontar para uma fonte de dados, pelo que
        este formulário falhará ao ser guardado se remover gráficos de uma fonte de
        dados. Se pretender alterar a fonte de dados de um gráfico, substitua o gráfico
        da 'visão de exploração'
      ru: Список диаграмм, использующих эту таблицу. Если вы измените этот источник
        данных, возможно, вам придется отредактировать их настройки. Обратите внимание,
        что ваши изменения не удастся сохранить, если при этом придется отключить
        диаграммы от источника.
      sk: ''
      sl: Seznam grafikonov, povezanih s to tabelo. S spreminjanjem podatkovnega vira
        lahko spremenite, kako se povezani grafikoni obnašajo. Poleg tega morajo biti
        grafikoni povezani s podatkovnim virom. Če odstranite grafikon s podatkovnega
