        grafikona, prepišite grafikon v raziskovalnem pogledu.
      tr: ''
      uk: Список діаграм, пов’язаних з цією таблицею. Змінюючи цю дані, ви можете
        змінити, як поводяться ці пов'язані діаграми. Також зауважте, що діаграми
        повинні вказати на даний момент, тому ця форма не зможе зберегти, якщо видалити
