  ? The minimum number of rolling periods required to show a value. For instance if
    you do a cumulative sum on 7 days you may want your "Min Period" to be 7, so that
    all data points shown are the total of 7 periods. This will hide the "ramp up"
    taking place over the first 7 periods
  : ai_translations: {}
    metadata: {}
    msgid: The minimum number of rolling periods required to show a value. For instance
      if you do a cumulative sum on 7 days you may want your "Min Period" to be 7,
      so that all data points shown are the total of 7 periods. This will hide the
      "ramp up" taking place over the first 7 periods
    occurances: []
    po_translations:
      ar: الحد الأدنى لعدد فترات التدوير المطلوبة لإظهار القيمة. على سبيل المثال،
        إذا قمت بعمل مبلغ تراكمي في 7 أيام، فقد ترغب في أن تكون «الفترة الدنيا» 7،
        بحيث تكون جميع نقاط البيانات المعروضة هي إجمالي 7 فترات. سيؤدي هذا إلى إخفاء
        «الزيادة» التي تحدث خلال الفترات السبع الأولى
      de: Die Mindestanzahl von rollierender Perioden, die erforderlich sind, um einen
        Wert anzuzeigen. Wenn Sie beispielsweise eine kumulative Summe an 7 Tagen
        durchführen, möchten Sie möglicherweise, dass Ihr "Mindestzeitraum" 7 beträgt,
        so dass alle angezeigten Datenpunkte die Summe von 7 Perioden sind. Dies wird
        den "Hochlauf" verbergen, der in den ersten 7 Perioden stattfindet
      es: El número mínimo de períodos de desplazamiento necesarios para mostrar un
        valor. Por ejemplo, si realizas una suma acumulada en 7 días, es posible que
        quieras que tu "Período mínimo" sea 7, de modo que todos los puntos de datos
        mostrados sean el total de 7 períodos. Esto ocultará el "incremento" que tendrá
        lugar durante los primeros 7 períodos.
      fr: Le nombre minimum de périodes glissantes requises pour afficher une valeur.
        Par exemple, si vous effectuez une somme cumulative sur sept jours, vous voudrez
        peut-être que votre « période minimale » soit de sept, de sorte que tous les
        points de données affichés correspondent au total de sept périodes. Cela cachera
        la « hausse » qui a lieu au cours des sept premières périodes.
      it: ''
      ja: 値を表示するために必要なローリング期間の最小数。たとえば、7 日間の累積合計を計算する場合、表示されるすべてのデータ ポイントが 7 期間の合計になるように、「最小期間」を
        7 に設定することができます。これにより、最初の 7 期間にわたって行われる「ランプアップ」が非表示になります。
      ko: ''
      nl: Het minimum aantal rolperiodes dat nodig is om een waarde weer te geven.
        Bijvoorbeeld, als je een cumulatief bedrag op 7 dagen doet, kan je je "Min
        Period" 7 willen hebben, zodat alle getoonde datapunten het totaal van 7 periodes
        zijn. Dit zal de "aanloopperiode" verbergen die plaatsvindt in de eerste 7
        periodes
      pt: O número mínimo de períodos de rolamento necessários para mostrar um valor.
        Por exemplo, numa soma cumulativa de 7 dias é possível que o "Período Mínimo"
        seja 7, de forma a que todos os pontos de dados mostrados sejam o total de
        7 períodos. Esta opção esconde a "aceleração" que ocorre nos primeiros 7 períodos
      pt_BR: O número mínimo de períodos de rolagem necessários para mostrar um valor.
        Por exemplo, se você fizer uma soma cumulativa em 7 dias, talvez queira que
        seu "Min Period" seja 7, de modo que todos os pontos de dados mostrados sejam
        o total de 7 períodos. Isso ocultará o "ramp up" que ocorre nos primeiros
        7 períodos
      ru: Минимальное количество скользящих периодов, необходимое для отображения
        значения. Например, если вы хотите рассчитать сумму накопленным итогом за
        7 дней, вы можете задать "Минимальный период" равным 7. Благодаря этому можно
        будет избежать скачка значений на протяжении первых семи дней, когда данных
        для расчета еще мало.
      sk: ''
      sl: Minimalno število drsečih obdobij, potrebnih za prikaz vrednosti. Če računate
        kumulativno vsoto 7-dnevnega obdobja, boste nastavili "Min. št. period" na
        7. Tako bodo vse prikazane točke skupaj obsegale 7 obdobij. To bo prikrilo
        rampo, ki bi trajala prvih 7 obdobij
      tr: ''
      uk: Мінімальна кількість періодів прокатки, необхідні для показу значення. Наприклад,
        якщо ви робите накопичувальну суму на 7 днів, ви можете захотіти, щоб ваш
        "мінливий період" був 7, так що всі показані точки даних - це загальна кількість
        7 періодів. Це приховає "рампу", що відбудеться протягом перших 7 періодів
      zh: 显示值所需的滚动周期的最小值。例如，如果您想累积 7 天的总额，您可能希望您的“最小周期”为 7，以便显示的所有数据点都是 7 个区间的总和。这将隐藏掉前
        7 个阶段的“加速”效果
      zh_TW: 顯示值所需的滚動週期的最小值。例如，如果您想累積 7 天的總額，您可能希望您的“最小週期”為 7，以便顯示的所有數據點都是 7 個區間的總和。這將隐藏掉前
        7 個階段的“加速”效果
    trimmed_msgid: The minimum number of rolling periods required to show a value.
      For instance if you do a cumulative sum on 7 days you may want your "Min Period"
      to be 7, so that all data points shown are the total of 7 periods. This will
      hide the "ramp up" taking place over the first 7 periods
