        0 pour désactiver la mise en grappe, mais faites attention, car un grand nombre
        de points (>1 000) causera un décalage.
      it: ''
      ja: アルゴリズムがクラスターを定義するために使用する半径 (ピクセル単位)。クラスタリングをオフにするには 0 を選択しますが、ポイントの数が多い
