  ? The time range for the visualization. All relative times, e.g. "Last month", "Last
    7 days", "now", etc. are evaluated on the server using the server's local time
    (sans timezone). All tooltips and placeholder times are expressed in UTC (sans
    timezone). The timestamps are then evaluated by the database using the engine's
    local timezone. Note one can explicitly set the timezone per the ISO 8601 format
    if specifying either the start and/or end time.
  : ai_translations: {}
    metadata: {}
    msgid: The time range for the visualization. All relative times, e.g. "Last month",
      "Last 7 days", "now", etc. are evaluated on the server using the server's local
      time (sans timezone). All tooltips and placeholder times are expressed in UTC
      (sans timezone). The timestamps are then evaluated by the database using the
      engine's local timezone. Note one can explicitly set the timezone per the ISO
      8601 format if specifying either the start and/or end time.
    occurances: []
    po_translations:
      ar: النطاق الزمني للتصور. يتم تقييم جميع الأوقات النسبية، مثل «الشهر الماضي»
        و «آخر 7 أيام» و «الآن» وما إلى ذلك على الخادم باستخدام التوقيت المحلي للخادم
        (بدون منطقة زمنية). يتم التعبير عن جميع تلميحات الأدوات وأوقات العناصر النائبة
        بالتوقيت العالمي المنسق (بدون منطقة زمنية). ثم يتم تقييم الطوابع الزمنية بواسطة
        قاعدة البيانات باستخدام المنطقة الزمنية المحلية للمحرك. لاحظ أنه يمكن للمرء
        تعيين المنطقة الزمنية بشكل صريح وفقًا لتنسيق ISO 8601 في حالة تحديد وقت البدء
        و/أو وقت الانتهاء.
      de: Der Zeitraum für die Visualisierung. Alle relativen Zeiten, z.B. "Letzter
        Monat", "Letzte 7 Tage", "jetzt" usw., werden auf dem Server anhand der Ortszeit
        des Servers (ohne Zeitzone) ausgewertet. Alle QuickInfos und Platzhalterzeiten
        werden in UTC (ohne Zeitzone) ausgedrückt. Die Zeitstempel werden dann von
        der Datenbank anhand der lokalen Zeitzone des Moduls ausgewertet. Beachten
        Sie, dass man die Zeitzone explizit nach dem ISO 8601-Format festlegen kann,
        wenn entweder die Start- und/oder Endzeit angegeben wird.
      es: ''
      fr: L'intervalle de temps pour la visualisation. Tous les temps relatifs, par
        exemple « Mois dernier », « 7 derniers jours », « maintenant », etc. sont
        évalués sur le serveur en utilisant l'heure locale du serveur (sans fuseau
        horaire). Toutes les infobulles et les heures des « espaces réservés » sont
        exprimées en UTC (sans fuseau). Les horodatages sont alors évalués par la
        base données en utilisant le fuseau horaire local du serveur. Notez que l'on
        peut indiquer explicitement la fuseau horaire dans le format ISO 8601 quand
        on spécifie l'heure de début et/ou de fin.
      it: ''
      ja: '視覚化の時間範囲。すべての相対時間、例: 「先月」、「過去 7 日間」、「現在」などは、サーバーの現地時間 (タイムゾーンなし) を使用してサーバー上で評価されます。すべてのツールチップとプレースホルダーの時間は
        UTC (タイムゾーンなし) で表されます。次に、タイムスタンプは、エンジンのローカル タイムゾーンを使用してデータベースによって評価されます。開始時刻と終了時刻、あるいはその両方を指定する場合は、ISO
        8601 形式に従ってタイムゾーンを明示的に設定できることに注意してください。'
      ko: ''
      nl: Het tijdsbereik voor de visualisatie. Alle relatieve tijden, bijvoorbeeld
        "Afgelopen maand", "Laatste 7 dagen", "nu", etc. worden geëvalueerd op de
        server door gebruik te maken van de lokale tijd (zonder tijdzone). Alle tooltips
        en de tijd van de tijdelijke placeholder worden uitgedrukt in UTC (zonder
        tijdzone). De tijdstempels worden vervolgens geëvalueerd door de database
        met behulp van de lokale tijdzone van de engine. Merk op dat de tijdzone per
        ISO 8601 formaat expliciet kan worden ingesteld als de start- en/of eindtijd
        wordt aangegeven.
      pt: ''
      pt_BR: O intervalo de tempo para a visualização. Todos os horários relativos,
        por exemplo, "Last month", "Last 7 days", "now" etc., são avaliados no servidor
        usando o horário local do servidor (sem fuso horário). Todas as dicas de ferramentas
        e horários de espaço reservado são expressos em UTC (sem fuso horário). Os
        registros de data e hora são avaliados pelo banco de dados usando o fuso horário
        local do mecanismo. Observe que é possível definir explicitamente o fuso horário
        de acordo com o formato ISO 8601 ao especificar a hora inicial e/ou final.
      ru: Временной интервал для визуализации. Относительно время, например, "Последний
        месяц", "Последние 7 дней" и т.д. рассчитываются на сервере, используя локальное
        время сервера. Обратите внимание, что вы можете самостоятельно задать часовой
        пояс по формату ISO 8601 при пользовательской настройке, задав время начала
        и/или конца.
      sk: ''
      sl: Časovno obdobje za vizualizacijo. Vsi relativni časi, kot npr. "Zadnji mesec",
        Zadnjih 7 dni", "Zdaj" so izračunani na strežniku z njegovim lokalnim časom.
        Vsi opisi orodij in časi so izraženi v UTC. Časovne značke se nato izračunajo
        v podatkovni bazi z njenim lokalnim časovnim pasom. Eksplicitno lahko nastavite
        časovni pas v ISO 8601 formatu, če določite čas začetka ali konca.
      tr: ''
      uk: Часовий діапазон для візуалізації. Усі відносні часи, напр. "Минулого місяця",
        "Останні 7 днів", "тепер" тощо. На сервері оцінюються за допомогою локального
        часу сервера (SANS Timezone). Усі часи підказки та часи заповнювача виражаються
        в UTC (SANS Timezone). Потім часові позначки оцінюються базою даних за допомогою
        локального часу двигуна. Примітка можна чітко встановити часовий пояс на формат
        ISO 8601, якщо вказати або час запуску та/або кінця.
      zh: 可视化的时间范围。所有相关的时间，例如"上个月"、"过去7天"、"现在"等，都在服务器上使用服务器的本地时间（sans时区）进行计算。所有工具提示和占位符时间均以UTC（无时区）表示。然后，数据库使用引擎的本地时区来评估时间戳。注：如果指定开始时间和、或者结束时间，可以根据ISO
        8601格式显式设置时区。
      zh_TW: 可視化的時間範圍。所有相關的時間，例如"上個月"、"過去7天"、"現在"等，都在服務器上使用服務器的本地時間（sans時區）進行計算。所有工具提示和占位符時間均以UTC（無時區）表示。然後，資料庫使用引擎的本地時區來评估時間戳。注：如果指定開始時間和、或者结束時間，可以根据ISO
        8601格式顯式設定時區。
    trimmed_msgid: The time range for the visualization. All relative times, e.g.
