    msgid: These parameters are generated dynamically when clicking the save or overwrite
      button in the explore view. This JSON object is exposed here for reference and
      for power users who may want to alter specific parameters.
    occurances: []
    po_translations:
      ar: يتم إنشاء هذه المعلمات ديناميكيًا عند النقر فوق زر الحفظ أو الكتابة فوقه
        في عرض الاستكشاف. يتم عرض كائن JSON هذا هنا كمرجع وللمستخدمين المحترفين الذين
        قد يرغبون في تغيير معايير محددة.
      de: Diese Parameter werden dynamisch generiert, wenn Sie in der Explore-Ansicht
        auf die Schaltfläche Speichern oder Überschreiben klicken. Dieses JSON-Objekt
        wird hier als Referenz und für Hauptbenutzer*in verfügbar gemacht, die möglicherweise
        bestimmte Parameter ändern möchten.
      es: Estos parámetros se generan dinámicamente al hacer clic en el botón Guardar
        o sobrescribir en la vista de exploración. Este objeto JSON se expone aquí
        como referencia y para usuarios avanzados que quieran modificar parámetros
        específicos.
      fr: Ces paramètres sont générés dynamiquement lorsque vous cliquez sur le bouton
        d'enregistrement ou d'écrasement dans la vue d'exploration. Cet objet JSON
        est exposé ici à titre de référence et pour les utilisateurs expérimentés
        qui souhaiteraient modifier des paramètres spécifiques.
      it: Questi parametri sono generati dinamicamente al clic su salva o con il bottone
        di sovrascrittura nella vista di esplorazione. Questo oggetto JSON è esposto
        qui per referenza e per utenti esperti che vogliono modificare parametri specifici.
      ja: これらのパラメータは、探索ビューで保存または上書きボタンをクリックすると動的に生成されます。この JSON オブジェクトは、参照用と、特定のパラメーターを変更したいパワー
        ユーザーのためにここに公開されています。
      ko: ''
      nl: Deze parameters worden dynamisch gegenereerd bij het klikken op opslaan
        of overschrijven knop in de verkenningsweergave. Dit JSON-object is hier blootgesteld
        ter referentie en voor gevorderde gebruikers die mogelijk specifieke parameters
        willen wijzigen.
      pt: Os parâmetros são gerados dinamicamente ao clicar no botão Guardar ou Substituir
        na vista de exibição. Este objeto JSON é exposto aqui para referência e para
        utilizadores avançados que desejam alterar parâmetros específicos.
      pt_BR: Esses parâmetros são gerados dinamicamente quando se clica no botão salvar
        ou sobrescrever na exibição de exploração. Esse objeto JSON é exposto aqui
        para referência e para usuários avançados que queiram alterar parâmetros específicos.
      ru: Эти параметры генерируются автоматически при нажатии кнопки сохранения.
        Опытные пользователи могут изменить определенные объекты в формате JSON.
      sk: ''
      sl: Ti parametri se ustvarijo dinamično s klikom gumba Shrani ali Prepiši v
