  ? This control filters the whole chart based on the selected time range. All relative
    times, e.g. "Last month", "Last 7 days", "now", etc. are evaluated on the server
    using the server's local time (sans timezone). All tooltips and placeholder times
    are expressed in UTC (sans timezone). The timestamps are then evaluated by the
    database using the engine's local timezone. Note one can explicitly set the timezone
    per the ISO 8601 format if specifying either the start and/or end time.
  : ai_translations: {}
    metadata: {}
    msgid: This control filters the whole chart based on the selected time range.
      All relative times, e.g. "Last month", "Last 7 days", "now", etc. are evaluated
      on the server using the server's local time (sans timezone). All tooltips and
      placeholder times are expressed in UTC (sans timezone). The timestamps are then
      evaluated by the database using the engine's local timezone. Note one can explicitly
      set the timezone per the ISO 8601 format if specifying either the start and/or
      end time.
    occurances: []
    po_translations:
      ar: يقوم عنصر التحكم هذا بتصفية المخطط بالكامل بناءً على النطاق الزمني المحدد.
        يتم تقييم جميع الأوقات النسبية، مثل «الشهر الماضي» و «آخر 7 أيام» و «الآن»
        وما إلى ذلك على الخادم باستخدام التوقيت المحلي للخادم (بدون منطقة زمنية).
        يتم التعبير عن جميع تلميحات الأدوات وأوقات العناصر النائبة بالتوقيت العالمي
        المنسق (بدون منطقة زمنية). ثم يتم تقييم الطوابع الزمنية بواسطة قاعدة البيانات
        باستخدام المنطقة الزمنية المحلية للمحرك. لاحظ أنه يمكن للمرء تعيين المنطقة
        الزمنية بشكل صريح وفقًا لتنسيق ISO 8601 في حالة تحديد وقت البدء و/أو وقت الانتهاء.
      de: ''
      es: ''
      fr: Définissez une fonction qui reçoit l'entrée et produit le contenu d'une
        info-bulle
      it: ''
      ja: 'このコントロールは、選択した時間範囲に基づいてチャート全体をフィルターします。すべての相対時間、例: 「先月」、「過去 7 日間」、「現在」などは、サーバーの現地時間
        (タイムゾーンなし) を使用してサーバー上で評価されます。すべてのツールチップとプレースホルダーの時間は UTC (タイムゾーンなし) で表されます。次に、タイムスタンプは、エンジンのローカル
        タイムゾーンを使用してデータベースによって評価されます。開始時刻と終了時刻、あるいはその両方を指定する場合は、ISO 8601 形式に従ってタイムゾーンを明示的に設定できることに注意してください。'
      ko: ''
      nl: Dit bedieningselement filtert het hele diagram op basis van het geselecteerde
        tijdsbereik. Alle relatieve tijden, bijv. "Vorige maand", "Laatste 7 dagen",
        "nu", etc. worden geëvalueerd op de server door gebruik te maken van de lokale
        tijd (zonder tijdzone). Alle tooltips en placeholder tijdsaanduidingen worden
        uitgedrukt in UTC (zonder tijdzone). De tijdstempels worden vervolgens geëvalueerd
        in de database met behulp van de lokale tijdzone van de engine. Merk op dat
        de tijdzone per ISO 8601 formaat expliciet kan worden ingesteld als de start-
        en/of eindtijd wordt aangegeven.
      pt: ''
      pt_BR: ''
      ru: Этот элемент фильтрует всю диаграмму по выбранному диапазону времени. Все
        относительные даты ("последний месяц", "последние 7 дней", "сейчас" и т.п.)
        вычисляются на основе времени сервера без учета часового пояса. Все всплывающие
        подсказки приведены в UTC (без часового пояса). Временные метки обрабатываются
        базой данных, используя ее локальное время. Заметьте, что при указании времени
        начала и окончания можно задать часовой пояс в явном виде в формате ISO 8601.
      sk: ''
      sl: Ta kontrolnik filtrira celoten grafikon glede na izbrano časovno obdobje.
        Vsi relativni časi (npr. Zadnji mesec, Zdaj, itd.) so izračunani glede na
        lokalni čas strežnika (časovni pas ni upoštevan). Vsi opisi orodij in časovne
        oznake so izražene kot UTC. Časovne značke so potem določene glede na lokalni
        čas podatkovne baze. Eksplicitno lahko določite časovni pas v ISO 8601 formatu,
        če določite začetni in/ali končni čas.
      tr: ''
      uk: ''
      zh: ''
      zh_TW: ''
    trimmed_msgid: This control filters the whole chart based on the selected time
