  ? This is the condition that will be added to the WHERE clause. For example, to
    only return rows for a particular client, you might define a regular filter with
    the clause `client_id = 9`. To display no rows unless a user belongs to a RLS
    filter role, a base filter can be created with the clause `1 = 0` (always false).
  : ai_translations: {}
    metadata: {}
    msgid: This is the condition that will be added to the WHERE clause. For example,
      to only return rows for a particular client, you might define a regular filter
      with the clause `client_id = 9`. To display no rows unless a user belongs to
      a RLS filter role, a base filter can be created with the clause `1 = 0` (always
      false).
    occurances: []
    po_translations:
      ar: هذا هو الشرط الذي سيتم إضافته إلى جملة WHERE. على سبيل المثال، لإرجاع صفوف
        لعميل معين فقط، يمكنك تحديد عامل تصفية عادي باستخدام العبارة `client_id =
        9`. لعرض أي صفوف ما لم يكن المستخدم ينتمي إلى دور عامل تصفية RLS، يمكن إنشاء
        عامل تصفية أساسي باستخدام العبارة `1 = 0` (always false).
      de: Dies ist die Bedingung, die der WHERE-Klausel hinzugefügt wird. Um beispielsweise
        nur Zeilen für eine*n bestimmte*n Klient*n zurückzugeben, können Sie einen
        regulären Filter mit der Klausel "client_id = 9" definieren. Um keine Zeilen
        anzuzeigen, es sei denn, ein*e Benutzer*in gehört einer RLS-Filterrolle an,
        kann ein Basisfilter mit der Klausel '1 = 0' (immer falsch) erstellt werden.
      es: ''
      fr: Ceci est la condition qui sera ajoutée à la clause WHERE. Par exemple, pour
        ne retourner que les lignes d'un client particulier, vous pouvez définir un
        filtre régulier avec la clause « client_id = 9 ». Pour n'afficher aucune ligne
        sauf pour les utilisateur·rice·s qui appartiennent à un role de filtre RLS,
        un filtre de base peut être créé avec la  clause « 1 = 0 » (toujours faux).
      it: ''
      ja: これは、WHERE 句に追加される条件です。たとえば、特定のクライアントの行のみを返すには、「client_id = 9」句を使用して通常のフィルターを定義できます。ユーザーが
        RLS フィルター ロールに属していない限り行を表示しないようにするには、句 `1 = 0` (常に false) を使用してベース フィルターを作成できます。
      ko: ''
      nl: Dit is de voorwaarde die aan de WHERE clausule zal worden toegevoegd. Om
        bijvoorbeeld alleen rijen terug te krijgen voor een bepaalde client, kan je
        een standaard filter definiëren met de clausule `client_id = 9`. Om geen rijen
        te weergeven, tenzij een gebruiker tot een RLB filterrol behoort, kan een
        basis filter kan worden gemaakt met de clausule `1 = 0` (altijd onwaar).
      pt: ''
      pt_BR: Essa é a condição que será adicionada à cláusula WHERE. Por exemplo,
        para retornar apenas as linhas de um cliente específico, você pode definir
        um filtro regular com a cláusula `client_id = 9`. Para não exibir nenhuma
        linha a menos que um usuário pertença a uma função de filtro RLS, um filtro
        básico pode ser criado com a cláusula `1 = 0` (sempre falso).
      ru: Это условие, которое будет добавлено к оператору WHERE. Например, чтобы
        возвращать строки только для определенного клиента, вы можете определить обычный
        фильтр с условием `client_id = 9`. Чтобы не отображать строки, если пользователь
        не принадлежит к роли фильтра RLS, можно создать базовый фильтр с предложением
        `1 = 0` (всегда false).
      sk: ''
      sl: To je pogoj, ki bo dodan WHERE stavku. Npr., če želite dobiti vrstice za
        določeno stranko, lahko definirate regularni filter z izrazom 'id_stranke
        = 9'. Če ne želimo prikazati vrstic, razen če uporabnik pripada RLS vlogi,
        lahko filter ustvarimo z izrazom `1 = 0` (vedno FALSE).
      tr: ''
      uk: Це умова, яка буде додана до пункту «Де». Наприклад, щоб повернути лише
        рядки для певного клієнта, ви можете визначити звичайний фільтр із пунктом
        `client_id = 9`. Щоб не відображати рядків, якщо користувач не належить до
        ролі фільтра RLS, базовий фільтр може бути створений із пунктом `1 = 0` (завжди
        помилково).
      zh: 这是将会添加到WHERE子句的条件。例如，要仅返回特定客户端的行，可以使用子句 `client_id = 9` 定义常规过滤。若要在用户不属于RLS过滤角色的情况下不显示行，可以使用子句
        `1 = 0`（始终为false）创建基本过滤。
      zh_TW: 這是將會增加到 WHERE 子句的條件。例如，要僅返回特定客戶端的行，可以使用子句 `client_id = 9` 定義常規過濾。若要在用戶不属於
        RLS 過濾角色的情况下不顯示行，可以使用子句 `1 = 0`（始終為 false）創建基本過濾。
    trimmed_msgid: This is the condition that will be added to the WHERE clause. For
      example, to only return rows for a particular client, you might define a regular
      filter with the clause `client_id = 9`. To display no rows unless a user belongs
      to a RLS filter role, a base filter can be created with the clause `1 = 0` (always
      false).
