  ? This metric is used to define row selection criteria (how the rows are sorted)
    if a series or row limit is present. If not defined, it reverts to the first metric
    (where appropriate).
  : ai_translations: {}
    metadata: {}
    msgid: This metric is used to define row selection criteria (how the rows are
      sorted) if a series or row limit is present. If not defined, it reverts to the
      first metric (where appropriate).
    occurances: []
    po_translations:
      ar: يُستخدم هذا المقياس لتعريف معايير اختيار الصفوف (كيفية فرز الصفوف) في حالة
        وجود حد للسلسلة أو الصف. إذا لم يتم تعريفه، فإنه يعود إلى المقياس الأول (عند
        الاقتضاء).
      de: Metrik, die verwendet wird, um zu definieren, wie die obersten Reihen sortiert
        werden, wenn eine Reihen- oder Zeilenbegrenzung vorhanden ist. Wenn nicht
        definiert, wird auf die erste Metrik zurückgesetzt (falls zutreffend).
      es: ''
      fr: Métrique utilisée pour définir comment les séries principales sont triées
        si une limite de série ou de ligne est définie. Si indéfini, la première métrique
        sera utilisée (si approprié).
      it: ''
      ja: このメトリックは、系列または行の制限が存在する場合に、行の選択基準 (行の並べ替え方法) を定義するために使用されます。定義されていない場合は、(該当する場合)
        最初のメトリックに戻ります。
      ko: ''
      nl: Deze metriek wordt gebruikt om rij selectiecriteria te definiëren (hoe de
        rijen gesorteerd worden) als een rij limiet aanwezig is. Indien niet gedefinieerd,
        keert het terug naar de eerste metriek (indien gepast).
      pt: ''
      pt_BR: Métrica utilizada para definir a forma como as séries de topo são ordenadas
        se estiver presente um limite de série ou de linha. Se não for definida, reverte
        para a primeira métrica (quando apropriado).
      ru: Мера, используемая для сортировки строк, если включено ограничение по количеству
        категорий или строк. Если не указано, используется первая из мер (где это
        уместно).
      sk: ''
      sl: Mera, ki določa kako so razvrščene vrstice, če je določena omejitev serij
        ali vrstic. Če ni določena, se uporabi prva mera (kjer je ustrezno).
      tr: ''
      uk: Metric, що використовується для визначення того, як сортується верхня серія,
        якщо присутній ліміт серії або рядка. Якщо невизначений повернення до першої
        метрики (де це доречно).
      zh: 如果存在序列或行限制，则用于定义顶部序列的排序方式的度量。如果未定义，则返回第一个度量（如果适用）。
      zh_TW: 如果存在序列或行限制，则用於定義頂部序列的排序方式的度量。如果未定義，则返回第一個度量（如果適用）。
    trimmed_msgid: This metric is used to define row selection criteria (how the rows
      are sorted) if a series or row limit is present. If not defined, it reverts
      to the first metric (where appropriate).
