  ? 'Unable to connect. Verify that the following roles are set on the service account:
    "BigQuery Data Viewer", "BigQuery Metadata Viewer", "BigQuery Job User" and the
    following permissions are set "bigquery.readsessions.create", "bigquery.readsessions.getData"'
  : ai_translations: {}
    metadata: {}
    msgid: 'Unable to connect. Verify that the following roles are set on the service
      account: "BigQuery Data Viewer", "BigQuery Metadata Viewer", "BigQuery Job User"
      and the following permissions are set "bigquery.readsessions.create", "bigquery.readsessions.getData"'
    occurances: []
    po_translations:
      ar: 'غير قادر على الاتصال. تحقق من تعيين الأدوار التالية على حساب الخدمة: «عارض
        بيانات BigQuery»، «عارض البيانات الوصفية لـ BigQuery»، «مستخدم مهمة BigQuery»
        وتم تعيين الأذونات التالية «bigquery.readsessions.create»، «BigQuery.readSessions.getData»'
      de: 'Verbindung kann nicht hergestellt werden. Stellen Sie sicher, dass die
        folgenden Rollen für das Dienstkonto festgelegt sind: "BigQuery Data Viewer",
        "BigQuery Metadata Viewer", "BigQuery Job User" und die folgenden Berechtigungen
        festgelegt sind "bigquery.readsessions.create", "bigquery.readsessions.getData"'
      es: ''
      fr: 'Impossible de se connecter. Vérifiez que les rôles suivants sont définis
        sur le compte de service : « BigQuery Data Viewer », « BigQuery Metadata Viewer »,
        « BigQuery Job User » et que les permissions suivantes sont définies « bigquery.readsessions.create »,
        « bigquery.readsessions.getData »'
      it: ''
      ja: つなげられない。サービス アカウントに「BigQuery データ閲覧者」、「BigQuery メタデータ閲覧者」、「BigQuery ジョブ ユーザー」のロールが設定されていること、および「bigquery.readsessions.create」、「bigquery.readsessions.getData」の権限が設定されていることを確認します。
      ko: ''
      nl: 'Kan geen verbinding maken. Controleer of de volgende rollen zijn ingesteld
        op het service account: "BigQuery Data Viewer", "BigQuery Metadata Viewer",
        "BigQuery Job User" en de volgende permissies zijn ingesteld "bigquery. eadsessions.create",
        "bigquery.readsessions.getData"'
      pt: ''
      pt_BR: 'Não é possível se conectar. Verifique se as seguintes funções estão
        definidas na conta de serviço: "Visualizador de dados do BigQuery", "Visualizador
        de metadados do BigQuery", "Usuário do trabalho do BigQuery" e as seguintes
        permissões estão definidas "bigquery.readsessions.create", "bigquery.readsessions.getData"'
      ru: Не удалось подключиться. Проверьте, что сервисной учетной записи назначены
        роли "BigQuery Data Viewer", "BigQuery Metadata Viewer", "BigQuery Job User"
        и выставлены разрешения "bigquery.readsessions.create", "bigquery.readsessions.getData"
      sk: ''
      sl: 'Povezava neuspešna. Preverite če so v servisnem računu nastavljene naslednje
        vloge: "BigQuery Data Viewer", "BigQuery Metadata Viewer", "BigQuery Job User"
        in so nastavljena naslednja dovoljenja: "bigquery.readsessions.create", "bigquery.readsessions.getData"'
      tr: ''
      uk: 'Не може підключитися. Переконайтеся, що на обліковому записі служби встановлюються
        такі ролі: "Переглядач даних BigQuery", "Переглядач метаданих BigQuery", "Користувач
        роботи з великою роботою" та наступні дозволи встановлюються "bigquery.readsessions.create",
        "bigquery.readsessions.getData"'
      zh: ''
