  ? 'Used to summarize a set of data by grouping together multiple statistics along
    two axes. Examples: Sales numbers by region and month, tasks by status and assignee,
    active users by age and location. Not the most visually stunning visualization,
    but highly informative and versatile.'
  : ai_translations: {}
    metadata: {}
    msgid: 'Used to summarize a set of data by grouping together multiple statistics
      along two axes. Examples: Sales numbers by region and month, tasks by status
      and assignee, active users by age and location. Not the most visually stunning
      visualization, but highly informative and versatile.'
    occurances: []
    po_translations:
      ar: 'يُستخدم لتلخيص مجموعة من البيانات من خلال تجميع إحصائيات متعددة على محورين.
        أمثلة: أرقام المبيعات حسب المنطقة والشهر، والمهام حسب الحالة والمحال إليه،
        والمستخدمون النشطون حسب العمر والموقع. ليس التصور الأكثر روعة من الناحية المرئية،
        ولكنه غني بالمعلومات ومتعدد الاستخدامات.'
      de: 'Wird verwendet, um einen Datensatz zusammenzufassen, indem mehrere Statistiken
        entlang zweier Achsen gruppiert werden. Beispiele: Verkaufszahlen nach Region
        und Monat, Aufgaben nach Status und Beauftragtem, aktive Nutzer nach Alter
        und Standort. Nicht die visuell beeindruckendste Visualisierung, aber sehr
        informativ und vielseitig.'
      es: ''
      fr: 'Utilisé pour résumer un ensemble de données en regroupant plusieurs statistiques
        le long de deux axes. Exemples : Chiffre d''affaires par région et par mois,
        tâches par statut et par destinataire,utilisateur·rice·s actif·ve·s par âge
        et par lieu. Ce n''est pas la visualisation la plus impressionnante, mais
        elle est très informative et polyvalente.'
      it: ''
      ja: '2 つの軸に沿って複数の統計をグループ化することで、一連のデータを要約するために使用されます。例: 地域および月ごとの売上高、ステータスおよび担当者ごとのタスク、年齢および場所ごとのアクティブ
        ユーザー。最も視覚的に素晴らしいビジュアライゼーションではありませんが、非常に有益で多用途です。'
      ko: ''
      nl: 'Wordt gebruikt om een set gegevens samen te vatten door meerdere statistieken
        te groeperen over twee assen. Voorbeelden: Verkoop nummers per regio en per
        maand, taken per status en taakontvanger, actieve gebruikers per leeftijd
        en per locatie. Niet de meest visueel verbluffende visualisatie, maar zeer
        informatief en veelzijdig.'
      pt: ''
      pt_BR: 'Usado para resumir um conjunto de dados, agrupando várias estatísticas
        ao longo de dois eixos. Exemplos: Números de vendas por região e mês, tarefas
        por status e responsável, usuários ativos por idade e local. Não é a visualização
        mais impressionante visualmente, mas é altamente informativa e versátil.'
      ru: 'Используется для обобщения набора данных путем группировки нескольких показателей
        по двум осям. Примеры: показатели продаж по регионам и месяцам, задачи по
        статусу и назначенному лицу, активные пользователи по возрасту и местоположению.'
      sk: ''
      sl: Ponazori podatke na podlagi združevanja več statistik vzdolž dveh osi. Npr.
        prodaja po regijah in mesecih, opravila po statusih in izvajalcih, itd.
      tr: ''
      uk: 'Використовується для узагальнення набору даних шляхом групування кількох
        статистичних даних уздовж двох осей. Приклади: Номери продажів за регіоном
        та місяцем, завдання за статусом та правонаступником, активними користувачами
        за віком та місцезнаходженням. Не найбільш візуально приголомшлива візуалізація,
        але дуже інформативна та універсальна.'
      zh: 用于通过将多个统计信息分组在一起来汇总一组数据
      zh_TW: 用於通過將多個统計訊息分組在一起來彙總一組數據
    trimmed_msgid: 'Used to summarize a set of data by grouping together multiple
      statistics along two axes. Examples: Sales numbers by region and month, tasks
      by status and assignee, active users by age and location. Not the most visually
      stunning visualization, but highly informative and versatile.'
