  : ai_translations: {}
    metadata: {}
    msgid: Uses a gauge to showcase progress of a metric towards a target. The position
      of the dial represents the progress and the terminal value in the gauge represents
      the target value.
    occurances: []
    po_translations:
      ar: يستخدم مقياسًا لعرض تقدم المقياس نحو الهدف. يمثل موضع القرص التقدم وتمثل
        القيمة النهائية في المقياس القيمة المستهدفة.
      de: Verwendet ein Tachometer, um den Fortschritt einer Metrik in Richtung eines
        Ziels anzuzeigen. Die Position des Zifferblatts stellt den Fortschritt und
        der Endwert im Tachometer den Zielwert dar.
      es: ''
      fr: Utilise une jauge pour montrer la progression d’une mesure vers une cible.
        La position du cadran représente la progression et la valeur de borne dans
        la jauge représente la valeur cible.
      it: ''
      ja: ゲージを使用して、目標に向けたメトリクスの進捗状況を示します。ダイヤルの位置は進行状況を表し、ゲージの最終値は目標値を表します。
      ko: ''
      nl: Gebruikt een graadmeter om de voortgang van een metriek naar een doel te
        laten zien. De positie van de wijzer geeft de vooruitgang weer en de waarde
        in de meter vertegenwoordigt de doelwaarde.
      pt: ''
      pt_BR: Usa um medidor para mostrar o progresso de uma métrica em direção a uma
        meta. A posição do mostrador representa o progresso e o valor do terminal
        no medidor representa o valor-alvo.
      ru: Использует индикатор для демонстрации прогресса показателя в достижении
        цели. Положение циферблата показывает ход выполнения, а конечное значение
        на индикаторе представляет целевое значение.
      sk: ''
      sl: Uporablja števec za prikaz napredovanja mere k ciljni vrednosti. Položaj
        kazalca predstavlja napredek, končna vrednost na števcu pa ciljno vrednost.
      tr: ''
      uk: Використовує датчик для демонстрації прогресу метрики до цілі. Положення
        циферблату представляє прогрес, а значення терміналу в калібрі являє собою
        цільове значення.
      zh: 使用仪表盘来展示一个指标朝着目标的进度。指针的位置表示进度，而仪表盘的终点值代表目标值。
      zh_TW: 使用仪表盘來展示一個指標朝着目標的進度。指针的位置表示進度，而仪表盘的終點值代表目標值。
    trimmed_msgid: Uses a gauge to showcase progress of a metric towards a target.
      The position of the dial represents the progress and the terminal value in the
      gauge represents the target value.
  ? Uses circles to visualize the flow of data through different stages of a system.
    Hover over individual paths in the visualization to understand the stages a value
    took. Useful for multi-stage, multi-group visualizing funnels and pipelines.
  : ai_translations: {}
    metadata: {}
    msgid: Uses circles to visualize the flow of data through different stages of
      a system. Hover over individual paths in the visualization to understand the
      stages a value took. Useful for multi-stage, multi-group visualizing funnels
      and pipelines.
    occurances: []
    po_translations:
      ar: يستخدم الدوائر لتصور تدفق البيانات عبر مراحل مختلفة من النظام. مرر مؤشر
        الماوس فوق المسارات الفردية في التصور لفهم المراحل التي استغرقتها القيمة.
        مفيد لمسارات وخطوط الأنابيب للتصور متعددة المراحل ومتعددة المجموعات.
      de: Verwendet Kreise, um den Datenfluss durch verschiedene Phasen eines Systems
        zu visualisieren. Bewegen Sie den Mauszeiger über einzelne Pfade in der Visualisierung,
        um die Phasen zu verstehen, die ein Wert durchlaufen hat. Nützlich für die
        Visualisierung von Trichtern und Pipelines in mehreren Gruppen.
      es: ''
      fr: Utilise des cercles pour visualiser le flux de données à travers les différentes
        étapes d’un système. Placez le curseur sur les chemins individuels dans la
        visualisation pour comprendre les étapes qu’une valeur a suivies. Utile pour
        la visualisation d’entonnoirs et de pipelines à plusieurs étapes et groupes.
      it: ''
      ja: 円を使用して、システムのさまざまな段階を通るデータの流れを視覚化します。ビジュアライゼーション内の個々のパスの上にマウスを移動すると、値がどの段階を経たかを理解できます。マルチステージ、マルチグループのファネルとパイプラインの視覚化に役立ちます。
      ko: ''
      nl: Gebruikt cirkels om de doorstroming van gegevens door verschillende fasen
        van een systeem te visualiseren. Beweeg over individuele paden in de visualisatie
        om te begrijpen welke fasen een waarde heeft doorlopen. Handig voor het visualiseren
        van trechters en pijplijnen met meerdere fasen en groepen.
      pt: ''
      pt_BR: Usa círculos para visualizar o fluxo de dados em diferentes estágios
        de um sistema. Passe o mouse sobre caminhos individuais na visualização para
        entender os estágios de um valor. Útil para funis e pipelines de visualização
        de vários estágios e vários grupos.
      ru: Показывает поток значений через различные этапы системы с помощью окружностей.
        Наведите на путь в визуализации, чтобы показать, через какие этапы прошло
        значение. Эта диаграмма удобна, когда нужно показать воронку или поток с несколькими
        этапами или группами.
      sk: ''
      sl: S pomočjo krogov prikaže potek podatkov na različnih nivojih sistema. S
        premikom kurzorja prikaže vrednosti na posameznem nivoju. Uporabno za večnivojsko,
        večskupinsko vizualizacijo.
      tr: ''
      uk: Використовує кола для візуалізації потоку даних через різні етапи системи.
        Наведіть курсор на окремі шляхи візуалізації, щоб зрозуміти етапи, які взяла
        значення. Корисно для багатоступеневої, багатогрупової візуалізації воронки
        та трубопроводів.
      zh: 使用圆圈来可视化数据在系统不同阶段的流动。将鼠标悬停在可视化图表的各个路径上，以理解值经历的各个阶段。这对于多阶段、多组的漏斗和管道可视化非常有用。
      zh_TW: 使用圆圈來可視化數據在系统不同階段的流動。將鼠標懸停在可視化圖表的各個路徑上，以理解值經歷的各個階段。這對於多階段、多組的漏斗和管道可視化非常有用。
    trimmed_msgid: Uses circles to visualize the flow of data through different stages
      of a system. Hover over individual paths in the visualization to understand
      the stages a value took. Useful for multi-stage, multi-group visualizing funnels
      and pipelines.
