    occurances: []
    po_translations:
      ar: تصور مجموعة موازية من المقاييس عبر مجموعات متعددة. يتم تصور كل مجموعة باستخدام
        خط النقاط الخاص بها ويتم تمثيل كل مقياس كحافة في المخطط.
      de: Visualisieren Sie einen parallelen Satz von Metriken über mehrere Gruppen
        hinweg. Jede Gruppe wird mit einer eigenen Punktlinie visualisiert und jede
        Metrik wird als Kante im Diagramm dargestellt.
      es: ''
      fr: Visualisez un ensemble parallèle de mesures dans plusieurs groupes. Chaque
        groupe est visualisé en utilisant sa propre ligne de points et chaque mesure
        est représentée comme un bord dans le graphique.
      it: ''
      ja: 複数のグループにわたるメトリクスの並列セットを視覚化します。各グループは独自の点の線を使用して視覚化され、各メトリックはグラフ内のエッジとして表されます。
      ko: ''
      nl: Visualiseer een parallelle reeks metrieken over meerdere groepen. Elke groep
        wordt gevisualiseerd met behulp van zijn eigen lijn van punten en elk getal
        wordt weergegeven als een rand in de grafiek.
      pt: ''
      pt_BR: Visualize um conjunto paralelo de métricas em vários grupos. Cada grupo
        é visualizado usando sua própria linha de pontos e cada métrica é representada
        como uma borda no gráfico.
      ru: Визуализируйте меры для нескольких групп. Метрики представлены в виде ребер,
        а каждая группа - набором точек на этих ребрах.
      sk: ''
      sl: Prikaže vzporedni nabor mer za različne skupine. Vsaka skupina je prikazana
        s svojim naborom točk in vsaka mera s povezavo na grafikonu.
      tr: ''
      uk: Візуалізуйте паралельний набір показників у різних групах. Кожна група візуалізується
