      de: Visualisiert, wie eine einzelne Metrik in den Hauptunterteilungen eines
        Landes (Bundesstaaten, Provinzen usw.) auf einer Choroplethenkarte variiert.
        Der Wert jeder Unterteilung wird erhöht, wenn Sie den Mauszeiger über die
        entsprechende geografische Grenze bewegen.
      es: ''
      fr: Visualise la façon dont une seule mesure varie entre les principales subdivisions
        d’un pays (États, provinces, etc.) sur une carte de choroplète. La valeur
        de chaque subdivision est élevée lorsque vous survolez la limite géographique
        correspondante.
      it: ''
      ja: 単一の指標が国の主要な細分区域 (州、地方など) にわたってどのように変化するかをコロプレス マップ上で視覚化します。対応する地理的境界の上にマウスを移動すると、各区画の値が高くなります。
      ko: ''
      nl: Visualiseert hoe een enkele metriek varieert over de belangrijkste onderverdelingen
        van een land (staten, provincies, enz.) op een choropleth-kaart. De waarde
        van elke onderverdeling wordt verhoogd wanneer u over de overeenkomstige geografische
        grens zweeft.
      pt: ''
      pt_BR: Visualiza como uma única métrica varia entre as principais subdivisões
        de um país (estados, províncias etc.) em um mapa coroplético. O valor de cada
        subdivisão é elevado quando você passa o mouse sobre o limite geográfico correspondente.
      ru: Показывает на хороплет-карте, как меняется значение меры в зависимости от
