        на них.
      sk: ''
      sl: Prikaže kako se posamezna mera spreminja glede na območja države (dežele,
        province, itd.) na kloropletnem zemljevidu. Vsak podrazdelek se dvigne, ko
        z miško preidete mejo njegovega območja.
      tr: ''
      uk: Візуалізує, як одна метрика змінюється в основних підрозділах країни (держави,
        провінції тощо) на карті хороплета. Значення кожного підрозділу підвищується,
        коли ви наведете на відповідну географічну межу.
      zh: 在叶绿体地图上显示一个国家的主要分区（州、省等）之间单个指标的变化情况。当您悬停在相应的地理边界上时，每个分区的值都会升高
      zh_TW: 在葉绿體地圖上顯示一個國家的主要分區（州、省等）之間單個指標的變化情况。當您懸停在相應的地理邊界上時，每個分區的值都會升高
