  ? Visualizes the flow of different group's values through different stages of a
    system. New stages in the pipeline are visualized as nodes or layers. The thickness
    of the bars or edges represent the metric being visualized.
  : ai_translations: {}
    metadata: {}
    msgid: Visualizes the flow of different group's values through different stages
      of a system. New stages in the pipeline are visualized as nodes or layers. The
      thickness of the bars or edges represent the metric being visualized.
    occurances: []
    po_translations:
      ar: تصور تدفق قيم المجموعة المختلفة عبر مراحل مختلفة من النظام. يتم تصور المراحل
        الجديدة في خط الأنابيب كعقد أو طبقات. يمثل سمك الأشرطة أو الحواف المقياس الذي
        يتم تصويره.
      de: Visualisiert den Fluss der Werte verschiedener Gruppen durch verschiedene
        Phasen eines Systems. Neue Stufen in der Pipeline werden als Knoten oder Layer
        visualisiert. Die Dicke der Balken oder Kanten stellt die Metrik dar, die
        visualisiert wird.
      es: ''
      fr: Visualise le flux des valeurs de différents groupes à travers les différentes
        étapes d’un système. Les nouvelles étapes du pipeline sont visualisées comme
        des nœuds ou des couches. L’épaisseur des barres ou des bords représente la
        mesure visualisée.
      it: ''
      ja: システムのさまざまな段階におけるさまざまなグループの価値観の流れを視覚化します。パイプラインの新しいステージはノードまたはレイヤーとして視覚化されます。バーまたはエッジの太さは、視覚化されるメトリックを表します。
      ko: ''
      nl: Visualiseert de doorstroming van waarden van verschillende groepen door
        verschillende stadia van een systeem. Nieuwe stadia in de pijplijn worden
        weergegeven als knooppunten of lagen. De dikte van de balken of randen representeert
        de gevisualiseerde maatstaf.
      pt: ''
      pt_BR: Visualiza o fluxo de valores de diferentes grupos por meio de diferentes
        estágios de um sistema. Novos estágios no pipeline são visualizados como nós
        ou camadas. A espessura das barras ou bordas representa a métrica que está
        sendo visualizada.
      ru: Показывает поток значений разных групп через различные этапы в системе.
        Этапы представлены в виде узлов или слоев. Размер баров или краев соответствует
        значению меры.
      sk: ''
      sl: Prikaže potek vrednosti različnih skupin na različnih nivojih sistema. Novi
        nivoji so prikazani kot točke ali plasti. Debelina stolpcev ali povezav predstavlja
        prikazano mero.
      tr: ''
      uk: Візуалізує потік значень різних груп через різні етапи системи. Нові етапи
        в трубопроводі візуалізуються як вузли або шари. Товщина брусків або країв
        представляє показник, який візуалізується.
      zh: 可视化不同组的值在系统不同阶段的流动。管道中的新阶段被可视化为节点或层。条形或边缘的厚度表示正在可视化的度量。
      zh_TW: 可視化不同組的值在系统不同階段的流動。管道中的新階段被可視化為節點或層。條形或邊缘的厚度表示正在可視化的度量。
    trimmed_msgid: Visualizes the flow of different group's values through different
      stages of a system. New stages in the pipeline are visualized as nodes or layers.
      The thickness of the bars or edges represent the metric being visualized.
