    po_translations:
      ar: عند تحديد SQL، يعمل مصدر البيانات كعرض. سيستخدم Superset هذه العبارة كاستعلام
        فرعي أثناء التجميع والتصفية على الاستعلامات الأصلية التي تم إنشاؤها.
      de: Beim Angeben von SQL fungiert die Datenquelle als Ansicht. Superset verwendet
        diese Anweisung als Unterabfrage beim Gruppieren und Filtern der generierten
        übergeordneten Abfragen.
      es: ''
      fr: Lorsque vous spécifiez SQL, la source de données agit comme une vue. Superset
        utilisera cette déclaration comme une sous-requête tout en regroupant et en
        filtrant les requêtes parentales générées.
      it: ''
      ja: SQL を指定すると、データソースはビューとして機能します。スーパーセットは、生成された親クエリのグループ化とフィルター処理中に、このステートメントをサブクエリとして使用します。
      ko: ''
      nl: Bij het specificeren van SQL, fungeert de gegevensbron als een weergave.
        Superset zal deze verklaring gebruiken als een subquery tijdens het groeperen
        en filteren op de gegenereerde bovenliggende queries.
      pt: ''
      pt_BR: Ao especificar o SQL, a fonte de dados atua como uma visualização. O
        Superset usará essa instrução como uma subconsulta ao agrupar e filtrar as
        consultas pai geradas.
      ru: Когда указан SQL, источник данных работает как представление. При необходимости
        группировки и фильтрации Superset будет использовать это выражение в подзапросе.
      sk: ''
      sl: Ko podajate SQL, se podatkovni vir obnaša kot pogled (view). Superset bo
        ta zapis uporabil kot podpoizvedbo, pri čemer bo združeval in filtriral na
        podlagi ustvarjenih starševskih poizvedb.
      tr: ''
      uk: При вказівці SQL, DataSource виступає як погляд. Superset використовуватиме
        це твердження як підрозділ під час групування та фільтрації на створених батьківських
        запитах.
      zh: 指定SQL时，数据源会充当视图。在对生成的父查询进行分组和筛选时，系统将使用此语句作为子查询。
      zh_TW: 指定 SQL 時，數據源會充當視圖。在對生成的父查詢進行分組和篩選時，系统將使用此語句作為子查詢。
