  ? When using "Autocomplete filters", this can be used to improve performance of
    the query fetching the values. Use this option to apply a predicate (WHERE clause)
    to the query selecting the distinct values from the table. Typically the intent
    would be to limit the scan by applying a relative time filter on a partitioned
    or indexed time-related field.
  : ai_translations: {}
    metadata: {}
    msgid: When using "Autocomplete filters", this can be used to improve performance
      of the query fetching the values. Use this option to apply a predicate (WHERE
      clause) to the query selecting the distinct values from the table. Typically
      the intent would be to limit the scan by applying a relative time filter on
      a partitioned or indexed time-related field.
    occurances: []
    po_translations:
      ar: عند استخدام «فلاتر الإكمال التلقائي»، يمكن استخدام هذا لتحسين أداء الاستعلام
        الذي يجلب القيم. استخدم هذا الخيار لتطبيق المسند (عبارة WHERE) على الاستعلام
        الذي يحدد القيم المميزة من الجدول. عادةً ما يكون الهدف هو الحد من الفحص من
        خلال تطبيق عامل تصفية الوقت النسبي على حقل مقسم أو مفهرس متعلق بالوقت.
      de: Bei Verwendung von "AutoVervollständigen-Filtern" kann dies verwendet werden,
        um die Leistung der Abfrage zum Abrufen der Werte zu verbessern. Verwenden
        Sie diese Option, um ein Prädikat (WHERE-Klausel) auf die Abfrage anzuwenden,
        die die verschiedenen Werte aus der Tabelle auswählt. In der Regel besteht
        die Absicht darin, den Scan einzuschränken, indem ein relativer Zeitfilter
        auf ein partitioniertes oder indiziertes zeitbezogenes Feld angewendet wird.
      es: ''
      fr: Lorsque vous utilisez les « filtres de saisie semi-automatique », cette
        option peut être utilisée pour améliorer les performances de la requête qui
        récupère les valeurs. Utilisez cette option pour appliquer un prédicat (clause
        WHERE) à la requête en sélectionnant les valeurs distinctes du tableau. Généralement,
        l'objectif est de limiter l'analyse en appliquant un filtre temporel relatif
        sur un champ temporel partitionné ou indexé.
      it: ''
      ja: 「オートコンプリート フィルター」を使用する場合、これを使用して値を取得するクエリのパフォーマンスを向上させることができます。このオプションを使用して、テーブルから個別の値を選択するクエリに述語
        (WHERE 句) を適用します。通常、その目的は、パーティション化またはインデックス化された時間関連フィールドに相対時間フィルターを適用することでスキャンを制限することです。
      ko: ''
      nl: Wanneer u "Autocomplete filters" gebruikt, kan dit worden gebruikt om de
        prestaties van de query te verbeteren die deze waarden ophaalt. Gebruik deze
        optie om een voorspelling toe te passen (WHERE clausule) om de query te selecteren
        uit de verschillende waarden van de tabel. Meestal zou het doel zijn om het
        scannen te beperken door een relatieve tijdfilter toe te passen op een gepartitioneerd
        of geïndexeerd tijdgebonden veld.
      pt: ''
      pt_BR: Ao usar "Autocomplete filters", isso pode ser usado para melhorar o desempenho
        da consulta que busca os valores. Use essa opção para aplicar um predicado
        (cláusula WHERE) à consulta que seleciona os valores distintos da tabela.
        Normalmente, a intenção seria limitar a varredura aplicando um filtro de tempo
        relativo em um campo particionado ou indexado relacionado ao tempo.
      ru: При использовании "Фильтров автозаполнения" может использоваться для ускорения
        запроса. Используйте эту опцию для настройки предиката (оператор WHERE) запроса
        для уникальных значений из таблицы. Обычно целью является ограничение сканирования
        путем применения относительного временного фильтра к секционированному или
        индексированному полю типа дата/время.
      sk: ''
      sl: Ko uporabljate "Samodokončaj filtre", lahko s tem izboljšate hitrost pridobivanja
        rezultatov s poizvedbo. Z uporabo te možnosti dodate predikat (WHERE stavek)
        k poizvedbi za izbiro različnih vrednosti iz tabele. Običajno je namen omejiti
        poizvedbo z uporabo filtra za relativni čas na particioniranem ali indeksiranem
        časovnem polju.
      tr: ''
      uk: При використанні "автозаповнених фільтрів" це може бути використане для
        підвищення продуктивності запиту отримання значень. Використовуйте цю опцію,
        щоб застосувати предикат (де пункт) до запиту, що вибирає різні значення з
        таблиці. Зазвичай наміром було б обмежити сканування, застосовуючи відносний
        часовий фільтр на розділеному або індексованому поле, пов’язаному з часом.
      zh: 当使用 "自适配过滤条件" 时，这可以用来提高获取查询数据的性能。使用此选项可将谓词（WHERE子句）应用于从表中进行选择不同值的查询。通常，这样做的目的是通过对分区或索引的相关时间字段配置相对应的过滤时间来限制扫描。
      zh_TW: 當使用 "自適配過濾條件" 時，這可以用來提高獲取查詢數據的性能。使用此選項可將谓詞（WHERE 子句）應用於從表中進行選擇不同值的查詢。通常，這樣做的目的是通過對分區或索引的相關時間欄位配置相對應的過濾時間來限制掃描。
    trimmed_msgid: When using "Autocomplete filters", this can be used to improve
      performance of the query fetching the values. Use this option to apply a predicate
      (WHERE clause) to the query selecting the distinct values from the table. Typically
      the intent would be to limit the scan by applying a relative time filter on
      a partitioned or indexed time-related field.
