    msgid: You are importing one or more charts that already exist. Overwriting might
      cause you to lose some of your work. Are you sure you want to overwrite?
    occurances: []
    po_translations:
      ar: تقوم باستيراد مخطط واحد أو أكثر موجود بالفعل. قد تؤدي الكتابة الاستعلائية
        إلى فقدان بعض أعمالك. هل تريد بالتأكيد الكتابة فوقها؟
      de: Sie importieren ein oder mehrere Diagramme, die bereits vorhanden sind.
        Das Überschreiben kann dazu führen, dass Sie einen Teil Ihrer Arbeit verlieren.
        Sind Sie sicher, dass Sie überschreiben möchten?
      es: ''
      fr: Vous importez une ou plusieurs cartes qui existent déjà. L'écrasement pourrait
        vous faire perdre une partie de votre travail. Êtes-vous sûr de vouloir les
        écraser?
      it: ''
      ja: すでに存在する 1 つ以上のグラフをインポートしています。上書きすると、作業内容の一部が失われる可能性があります。上書きしてもよろしいですか?
      ko: ''
      nl: U importeert een of meer grafieken die al bestaan. Overschrijven kan leiden
        tot verlies van je werk. Weet je zeker dat je wilt overschrijven?
      pt: ''
      pt_BR: Você está importando um ou mais gráficos que já existem. A substituição
        pode fazer com que você perca parte do seu trabalho. Tem certeza de que deseja
        substituir?
      ru: Вы импортируете одну или несколько диаграмм, которые уже существуют. Перезапись
        может привести к потере части вашей работы. Вы уверены, что хотите перезаписать?
      sk: ''
      sl: Uvažate enega ali več grafikonov, ki že obstajajo. S prepisom lahko izgubite
        podatke. Ali ste prepričani, da želite prepisati?
      tr: ''
      uk: Ви імпортуєте один або кілька діаграм, які вже існують. Перезавантаження
        може призвести до втрати частини своєї роботи. Ви впевнені, що хочете перезаписати?
