        مع المجمع. سيتم استخدام الأعمدة غير العددية لتسمية النقاط. اتركه فارغًا للحصول
        على عدد النقاط في كل مجموعة.'
      de: '''count'' ist COUNT(*), wenn ein ‚GROUP BY’ verwendet wird. Numerische
        Spalten werden mit der Aggregatfunktion aggregiert. Nicht numerische Spalten
        werden verwendet, um Punkte zu beschriften. Falls leer, wird die Anzahl der
        Punkte in jedem Cluster zurückgegeben.'
      es: ''
      fr: « count » est COUNT(*) si un groupe par est utilisé. Les colonnes numériques
        seront regroupées avec l’agrégateur. Les colonnes non numériques seront utilisées
        pour étiqueter les points. Laissez vide pour obtenir un compte de points dans
        chaque regroupement.
      it: ''
      ja: group by を使用する場合、`count` は COUNT(*) になります。数値列はアグリゲータで集計されます。数値以外の列は、ポイントにラベルを付けるために使用されます。各クラスター内のポイント数を取得するには、空のままにします。
      ko: ''
      nl: '`count` is COUNT(*) als een groep wordt gebruikt. Numerieke kolommen worden
        samengevoegd met de aggregator. Niet-numerieke kolommen worden gebruikt om
        punten te labelen. Laat leeg om een aantal punten in elk cluster te krijgen.'
      pt: ''
      pt_BR: '`count` é COUNT(*) se for usado um grupo por. As colunas numéricas serão
        agregadas com o agregador. As colunas não numéricas serão usadas para rotular
        os pontos. Deixe em branco para obter uma contagem de pontos em cada cluster.'
      ru: ''
      sk: ''
      sl: '`število` je COUNT(*), če je uporabljeno združevanje po (group by). Numerični
        stolpci bodo agregirani z agregatorjem. Ne-numerični stolpci, bodo uporabljeni
        za oznake točk. Pustite prazno, da dobite število točk v posamezni gruči.'
      tr: ''
      uk: '`Count` - це кількість (*), якщо група використовується. Числові стовпці
        будуть агреговані з агрегатором. Для маркування точок будуть використані нечислові
        стовпчики. Залиште порожнім, щоб отримати кількість балів у кожному кластері.'
      zh: 如果分组被使用 `count` 表示 COUNT(*)。数值列将与聚合器聚合。非数值列将用于维度列。留空以获得每个聚合群中的点计数。
