  ? "standard to ensure that the lexicographical ordering\n                      coincides\
    \ with the chronological ordering. If the\n                      timestamp format\
    \ does not adhere to the ISO 8601 standard\n                      you will need\
    \ to define an expression and type for\n                      transforming the\
    \ string into a date or timestamp. Note\n                      currently time\
    \ zones are not supported. If time is stored\n                      in epoch format,\
    \ put `epoch_s` or `epoch_ms`. If no pattern\n                      is specified\
    \ we fall back to using the optional defaults on a per\n                     \
    \ database/column name level via the extra parameter."
  : ai_translations: {}
    metadata: {}
    msgid: "standard to ensure that the lexicographical ordering\n               \
      \       coincides with the chronological ordering. If the\n                \
      \      timestamp format does not adhere to the ISO 8601 standard\n         \
      \             you will need to define an expression and type for\n         \
      \             transforming the string into a date or timestamp. Note\n     \
      \                 currently time zones are not supported. If time is stored\n\
      \                      in epoch format, put `epoch_s` or `epoch_ms`. If no pattern\n\
      \                      is specified we fall back to using the optional defaults\
      \ on a per\n                      database/column name level via the extra parameter."
    occurances: []
    po_translations:
      ar: " معيار لضمان الترتيب المعجمي\n يتزامن مع الترتيب الزمني. إذا كان\n لا يلتزم\
        \ تنسيق الطابع الزمني بمعيار ISO 8601\n ستحتاج إلى تحديد تعبير وكتابة لـ\n\
        \ تحويل السلسلة إلى تاريخ أو طابع زمني. ملاحظة\n لا يتم دعم المناطق الزمنية\
        \ حاليًا. إذا تم تخزين الوقت\n في شكل حقبة، ضع `epoch_s` أو `epoch_ms`. إذا\
        \ لم يكن هناك نمط\n تم تحديد أننا نعود إلى استخدام الإعدادات الافتراضية الاختيارية\
        \ على per\n مستوى اسم قاعدة البيانات/العمود عبر المعلمة الإضافية."
      de: " Standard genügen muss, um sicherzustellen, dass die lexikographische Reihenfolge\n\
        \                      mit der chronologischen Reihenfolge übereinstimmt.\
        \ Wenn das\n                      Zeitstempelformat nicht dem ISO 8601-Standard\
        \ entspricht,\n                      müssen Sie einen Ausdruck und einen Typ\
        \ definieren um\n                      die Zeichenfolge in ein Datum oder\
        \ einen Zeitstempel umzuwandeln.\n                      Hinweis: Derzeit werden\
        \ Zeitzonen nicht unterstützt. Wenn Zeit im\n                      Epochenformat\
        \ gespeichert ist, Geben Sie “epoch_s\" oder \"epoch_ms\" ein. \n        \
        \              Wenn kein Muster angegeben ist, greifen wir auf die Verwendung\
        \ der\n \n                      über den zusätzlichen Parameter angebbaren,\n\
        \                      optionalen Standardwerte zurück."
      es: ''
      fr: ' afin de garantir que l''ordre lexicographique coïncide avec l''ordre chronologique.
        Si le format de l''horodatage n''est pas conforme à la norme ISO 8601, vous
        devrez définir une expression et un type pour transformer la chaîne en date
        ou en horodatage. Notez que les fuseaux horaires ne sont pas pris en charge
        actuellement. Si l''heure est stockée au format epoch, mettez `epoch_s` ou
        `epoch_ms`. Si aucun modèle n''est spécifié, nous utilisons les valeurs par
        défaut optionnelles au niveau de chaque base de données/nom de colonne via
        le paramètre supplémentaire.'
      it: ''
      ja: "辞書編集上の順序を保証するための標準\n                      時系列順と一致します。もし\n             \
        \         タイムスタンプ形式は ISO 8601 標準に準拠していません\n                      式と型を定義する必要があります。\n\
        \                      文字列を日付またはタイムスタンプに変換します。注記\n                      現在、タイムゾーンはサポートされていません。時間が保存されている場合\n\
        \                      エポック形式では、`epoch_s` または `epoch_ms` を入力します。パターンがない場合\n\
        \                      が指定されている場合は、ごとにオプションのデフォルトを使用するようにフォールバックします。\n   \
        \                   追加パラメータによるデータベース/列名のレベル。"
      ko: ''
      nl: " standaard om ervoor te zorgen dat de lexicografische volgorde\n      \
        \                samenvalt met de chronologische volgorde. Als het tijdstempel\n\
        \                      niet overeenkomt met de ISO 8601 standaard\n      \
        \                dan moet u een expressie definiëren en typen voor\n     \
        \                 om de tekenreeks om te zetten in een datum of tijdstempel.\
        \ Note\n                      currently time zones are not supported Als de\
        \ tijd wordt opgeslagen\n                      in epoch formaat, zet `epoch_s`\
        \ of `epoch_ms`. Als er geen patroon\n                      is opgegeven,\
        \ vallen we terug naar de optionele standaardwaarden op een\n            \
        \          database/kolom naam niveau via de extra parameter."
      pt: ''
      pt_BR: "para garantir que a ordem lexicográfica coincida com a ordem cronológica.\
        \ Se o\n formato do timestamp não for aderente ao padrão ISO 8601\n você precisará\
        \ definir uma expressão e tipo para\n transformar o texto em data ou timestamp.\
        \ Nota:\n naturalmente fusos horários não são suportados. Se o tempo é armazenado\
        \ no formato epoch coloque ` epoch_s ` ou ` epoch_ms `. Se nenhum padrão for\
        \ especificado\nemos utilizar os padrões de acordo com cada nível do banco\
        \ de dados/nome de coluna via parâmetro extra."
      ru: ' стандарта для обеспечения того, чтобы лексикографический порядок совпадал
        с хронологическим порядком. Если формат временной метки не соответствует стандарту
        ISO 8601, вам нужно будет определить выражение и тип для преобразования строки
        в дату или временную метку. В настоящее время часовые пояса не поддерживаются.
        Если время хранится в формате эпохи, введите \`epoch_s\` или \`epoch_ms\`.
        Если шаблон не указан, будут использованы необязательные значения по умолчанию
        на уровне имен для каждой базы данных/столбца с помощью дополнительного параметра.'
      sk: ''
      sl: " standard, ki zagotavlja, de se leksikografsko razvrščanje\n          \
        \            sklada s kronološkim. Če oblika\n                      časovne\
